	 ('f6e6df29-1722-49d0-8925-fea1fdcd5e98'::uuid,'e71b3c70-6cdf-48b2-80d0-c2f2e9435136'::uuid,'"[{\"id\":\"2613ade3-5ac9-4b10-951e-50a4b2c8e772\",\"content\":\"In scientific writing, this trait was not found in any squid, octopus, or other mollusk.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"2d887686-7b07-4a2e-b52d-8990a6e3a7d1\",\"content\":\"Eduardo Sampaio, a biologist, observed something strange in the Red Sea in Egypt.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"ec8a8bf0-b6d4-46f5-8b80-048025b6a025\",\"content\":\"Then he would leave his mate for a few seconds to swim into a crack where eggs were laid.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"298fb90c-12ac-48da-8180-bc760a0f0cf3\",\"content\":\"Once a bigger male has mated with a female, he stays close to keep other males from mating with her.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"6033f66b-1b18-46ed-a23d-4d319a466e21\",\"content\":\"The little, shiny big fin reef squid, which lives in coral reefs all over the world, may be the first animal to care for its young.\",\"is_true\":true,\"key\":\"E\"}]"'),
