	 ('c9ce06d8-2661-4c18-b120-28e3cc0569bc'::uuid,'159d86ba-1073-4dbb-b5ce-f88f5d510e4c'::uuid,'"[{\"id\":\"2131518c-25dd-4e02-bedc-0435fe664a9f\",\"content\":\"Squid will come to extinction because they cannot handle their predators.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"4583ba5b-eaae-4ee3-ade8-73d5ad21010f\",\"content\":\"Scientists will abandon squid behavior research because it is hard to observe marine animals.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"92c29ba1-4142-47f9-b8a8-111b15ce2487\",\"content\":\"Research about squid behavior will still be conducted to learn more about male bigfin reef squid and the swimming position of colossal squid.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"10dfff7d-ae54-47fd-b73a-96e16c43d325\",\"content\":\"It will be proven that shiny bigfin reef squid have some similarities with colossal squid.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"25fa6e8e-60a6-4f51-a602-5c1df1ffe498\",\"content\":\"Colossal squid will start living in coral reefs because it is safe to lay eggs there.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('025fc249-d2d7-47d2-bcdd-417cd0410a23'::uuid,'263be524-424f-464d-af7b-ee1b9b9f0af6'::uuid,'"[{\"id\":\"71818cf2-5aea-4f82-a49e-f0d60a809bca\",\"content\":\"Substance of our body\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"a36a3a8d-846c-43d4-850e-36f252b5e6ce\",\"content\":\"Tooth enamel\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"1606fb11-aa37-4a1a-ab68-833f66ae5c2f\",\"content\":\"Our tooth\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"6b672b62-4c60-49d6-afb6-2b1da786f24f\",\"content\":\"Outermost part of our body\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"12d705c7-8b2f-4858-99dd-8cfad3d42d98\",\"content\":\"Bacteria from foods and drinks\",\"is_true\":false,\"key\":\"E\"}]"'),
