	 ('0d0a82a9-6b5c-4ff9-ab99-254c7aee9ca9'::uuid,'2c92583c-700d-46c7-b607-fbf637bd5731'::uuid,'"[{\"id\":\"b4f84262-1767-4ef5-b04f-abd57134bf56\",\"content\":\"the programs have introduced a reasonable knowledge of how to use ICT\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"2ee9afd8-2812-4d7a-8677-df6e03b3a42a\",\"content\":\"the programs have found out what ICT skills and knowledge the teachers need\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"31bfb9f1-d1c6-4ba0-8254-3c09dc5ef568\",\"content\":\"the programs have given materials related to the pre-service teachers'' perceptions of ICT\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"73157c47-53be-4f43-bb05-5e719a9266b8\",\"content\":\"the programs were still designed in reference to traditional educational technology and settings\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"b9a0f138-4f1e-44fc-a0ed-dbbd5eed5040\",\"content\":\"the programs have participants who are familiar with the processes of technology-mediated educational transactions\",\"is_true\":false,\"key\":\"E\"}]"'),
