	 ('7c0b48e3-5b27-4d35-aed6-ef2b9b09adad'::uuid,'d529cbea-a8b5-4b05-80f1-85eaa2287765'::uuid,'"[{\"id\":\"6f755473-21fa-412d-bcbc-ea50d5d1a62d\",\"content\":\"Sea ice growth slowed to a crawl and even started shrinking for a bit\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"da0cf3d9-4db3-469c-b140-2aba58b0c78e\",\"content\":\"A large area of the arctic saw temperatures as much as \\\\( 36^{\\\\circ} \\\\mathrm{F} \\\\) above normal\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"b1103fe4-690f-402d-8108-0f113b5a9c58\",\"content\":\"Temperatures stayed stuck in their September range, pausing sea ice growth\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"b0e5e556-efa9-4702-b867-ea31d4aa3f37\",\"content\":\"The increased temperatures on the ice edge encourage the growth of sea ice\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"8a64bcff-6292-410e-b3a5-f4e099df405e\",\"content\":\"Sea surface temperatures on the edge of the ice are also running well above normal in many places\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('e7e6de5d-b58d-4133-875d-e2e76dc191be'::uuid,'cb949533-eac0-4f1a-bbe6-96e932386ae0'::uuid,'"[{\"id\":\"edec2f9a-5ad2-443a-96bc-851fade2a6ab\",\"content\":\"Concerned\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"92f30aae-aa40-48d7-b29b-f26d454390f6\",\"content\":\"Ignorant\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"35ee14ed-cd6e-4a1a-ac31-174f675acd96\",\"content\":\"Pessimistic\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"918e1ccb-8fa5-40c8-9d3a-33acc121a2b3\",\"content\":\"Doubtful\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"057c5347-3149-4c2a-a0ce-9107f797f41d\",\"content\":\"Critical\",\"is_true\":true,\"key\":\"E\"}]"'),
	 ('fadf5ccb-7ea6-4d06-a52f-064ef6fe1995'::uuid,'dec3cf9f-5354-4d5a-a3b2-dabc1cea16fc'::uuid,'"[{\"id\":\"6bf2e22a-6889-4d72-89ef-7c599f89e643\",\"content\":\"The continuous rise in the percentage of atmospheric carbon dioxide is alarming use by its dangerous effect\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"a912edc3-1f2b-4077-8f77-d1eb978ef255\",\"content\":\"The use of coal, oil, and gasoline by the people of industrial civilization is giving the opportunity of a rise in carbon dioxide emissions\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"78636441-6922-4a29-a44a-ed035e26bcd5\",\"content\":\"Illegal logging also increases the carbon dioxide through decreasing number of plants and exposing soil to the sunlight\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"4c3d6e91-4ecf-4e4f-868a-dffd26924e0e\",\"content\":\"This will definitely increase the level of carbon dioxide tremendously\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"a7b94d4c-3911-4a56-bc6e-c1b7dc380537\",\"content\":\"Destruction of ozone layer increases the incidence of many health disorders and the diseases such as skin cancer, respiratory disease and low immunity problems\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('f95c95f5-1deb-472d-8814-ca100d65ee0c'::uuid,'d1c26c80-efae-4b3d-bf84-57481b469caf'::uuid,'"[{\"id\":\"8b16ad61-d766-4932-bbde-bc5dd1df0ce3\",\"content\":\"The effect of global warming may slightly raise the level of crops and marine resources.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"040f6044-25fb-4706-a8e7-d89a4eb236a3\",\"content\":\"High levels of weather changes may affect the increase of crops and marine resources.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"cc536b5a-a08e-48a3-9a5a-4909b5ae5309\",\"content\":\"Crops produced in different seasons and the source of food in the sea can be destroyed by the weather changes.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"52e109c9-bcd1-457d-85ad-df33b521701b\",\"content\":\"Global warming is probably enormously affecting a little rise in agricultural and marine products.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"99d8c9c8-5f2b-40aa-9fcc-c8306d7e0473\",\"content\":\"An increase in global warming probably has an effect on the crops and marine habitat.\",\"is_true\":true,\"key\":\"E\"}]"'),
