	 ('af0b48b9-a268-42eb-97cf-8a29fd9531ee'::uuid,'a910cf56-3a83-45ad-90af-cb9f665323a6'::uuid,'"[{\"id\":\"cb843f49-a819-46d4-b149-40ee85c64fc5\",\"content\":\"show technology use within the process of teaching and learning\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"03d2c0c1-8cd5-44c1-ae5e-322dd9a4308f\",\"content\":\"imply that educational technology leads to teaching effectiveness\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"16df70b6-f5e7-4209-8669-61311359fc7d\",\"content\":\"show the use of technology in classrooms is closely related to the indicators that lead to the success of education\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"b384efb3-d802-4836-b879-e509af4deca4\",\"content\":\"argue that the core curriculum classes without technology ranges from \\\\( 51 \\\\% \\\\) to \\\\( 63 \\\\% \\\\)\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"f80210a7-6879-4df3-afcc-0bb2322a32fd\",\"content\":\"suggest that incorporating technology into a school curriculum will bring about learning efficiency\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('8074881a-10ac-4038-b61f-d75cafcba070'::uuid,'cdb4f6a5-d127-45b2-a77c-219b297d6ce0'::uuid,'"[{\"id\":\"dbb37872-34a0-4e9a-b8a0-3e6d9f374b68\",\"content\":\"Some advantages can be enjoyed when someone uses herbal medicines. They do not result in long term effects and allergic reaction. They are natural and are useful for many purposes. They can be obtained casily at low price, or even for free. Herbal remedies can be used by people of different age groups.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"cdfca5dc-3b2d-423a-9780-944bc9ad8974\",\"content\":\"One of-the advantages of using herbal medication is its use for several purposes. Ginger can be used for health treatment as well as for meal flavouring. Similarly, peppermint gives fresh taste on your food and serves as an anti-depressant. It is then very useful to grow herbs in your garden.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"0fece406-b564-4d87-99b0-a790a66acd07\",\"content\":\"Being useful for some purposes simultaneously make herbs great choices. People can use them, not only for flavouring food, but also for medication. They are cheap or even free of charge. People can grow them easily at home.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"fea0359e-a7b7-4fcc-88b6-796c01f076d4\",\"content\":\"The jest positive side of herbal medicine is its natural nature. It is not only useful for adults but also for young people. The price is affordable. Moreover, they can be used for several purposes simultaneously.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"0386d3ee-a973-45b1-9570-fd0a8d05b9c4\",\"content\":\"Herbal remedies are useful for some reasons. The main reason is its low price. People can even have it without payment. Some are useful form multiple purposes.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('2de3e8c8-1c9e-4008-b8eb-9ec65bd2225c'::uuid,'f971727a-ab71-4b78-a9fd-452a1302ad86'::uuid,'"[{\"id\":\"4b6cb7ac-5414-4bf1-a910-e337657d3604\",\"content\":\"a bad feeling\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"c630cfcf-e50b-462c-be64-4730e68f0851\",\"content\":\"an unacceptable feeling\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"932a8740-e8f8-4270-a506-5736a53c9186\",\"content\":\"an unsustainable behavior\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"75bce6b1-8aa6-4c50-9b62-4e402bc55621\",\"content\":\"a different opinion\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"bc1af4b1-b536-485c-9a27-7894c552ce9d\",\"content\":\"a negative opinion\",\"is_true\":true,\"key\":\"E\"}]"'),
