	 ('8015c48b-7ddd-4304-b67c-beb19bd32e36'::uuid,'c9278f93-bac4-4cd9-826a-5660c4984f90'::uuid,'"[{\"id\":\"ea2d6063-bdf4-444b-879f-89998642f1f7\",\"content\":\"social proof\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"106b2492-f280-43ce-94ac-fe3531d2c53b\",\"content\":\"social disorder\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"cfad8153-66a1-4068-83c8-63bffade40ed\",\"content\":\"daily behavior\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"f6877152-38a8-463a-b94a-8a46a99d804a\",\"content\":\"sustainable behavior\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"f38a96b2-7c56-4480-b8d6-51fc5c46cce0\",\"content\":\"acceptable culture\",\"is_true\":false,\"key\":\"E\"}]"');
