	 ('7fee1d12-8a21-47d5-85ef-9eea6360c467'::uuid,'cbef2bcf-e864-4826-a57f-9e3f4a2185e6'::uuid,'"[{\"id\":\"b5c72044-3bd2-4182-a1e1-ed9f2fe7f8a0\",\"content\":\"Facebook adalah sebuah layanan jejaring sosial yang memiliki lebih dari satu miliar pengguna aktif.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"1a3263ec-5455-4a4a-8a21-0868410f48ae\",\"content\":\"Depresi adalah gangguan suasana hati yang dapat memengaruhi pola pikir, perasaan, dan cara menghadapi aktivitas sehari-hari,\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"c7e119de-db69-4528-b2f4-cb51c40b45f9\",\"content\":\"Para peneliti itu telah melakukan penelitian tentang hubungan media sosial dengan depresi dan kesepian.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"7ffd7ef8-e272-4fd7-adc8-6abe57959867\",\"content\":\"Penyebab depresi dan kesepian bervariasi serta meliputi faktor sosial, mental, emosional, dan fisik.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"2435aec1-f7bc-4179-8eee-ecd6f6aa5577\",\"content\":\"Untuk itu, sebaiknya masyarakat bijak dalam menggunakan media sosial agar terhindar dari dampak negatif.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('c180e8e9-7466-47f4-af27-63904db91901'::uuid,'69d89815-10d1-4642-87d8-e3f197f4bd68'::uuid,'"[{\"id\":\"607fbc27-588a-4266-9e99-e575fa3f6efb\",\"content\":\"Persentase kenaikan produksi rumput laut Sulsel lebih tinggi daripada NTT.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"64347bb8-e579-4900-a03e-4a8bab975f83\",\"content\":\"Provinsi Bali menduduki tingkat keempat dalam produksi rumput laut.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"92b146ae-cff2-401b-9c50-bdbfc55c16e4\",\"content\":\"Kenaikan produksi rumput laut Sulawesi Tenggara tidak konstan.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"5ff2a43d-1c59-43c2-8785-f7ab9e5dfab4\",\"content\":\"Produksi rumput laut tertinggi di setiap provinsi terjadi pada 2008.\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"9f0708d9-1090-494a-b041-38c097eb9cc5\",\"content\":\"Produksi rumput laut pada lima provinsi setiap tahun naik.\",\"is_true\":false,\"key\":\"E\"}]"'),
