	 ('84379841-e394-4548-9de9-b9d400e5963c'::uuid,'191ca7b0-5366-4f1b-907e-9110bc914622'::uuid,'"[{\"id\":\"b672ad67-fe01-4ffe-bafc-974d9285a522\",\"content\":\"Komunitas peduli sampah memamerkan lukisan Mengeja Laku Liku Kaliku.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"79364f40-4df3-415d-9c03-ddb12a853e3a\",\"content\":\"Komunitas peduli sampah mengadakan kegiatan budaya di tepi kali.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"0a5db276-b279-4661-b0d6-553d8850384c\",\"content\":\"Komunitas peduli sampah meningkatkan kepedulian warga akan kebersihan sungai.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"3fd56d9c-02f2-4f88-a795-03884e6a3bca\",\"content\":\"Komunitas peduli sampah memamerkan barang yang diproduksi dari sampah sungai.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"d522104f-013d-4401-8217-88a626e55b55\",\"content\":\"Komunitas peduli sampah memamerkan produk hasil daur ulang sampah.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('95d622b1-99d8-437e-9040-412660bd0df8'::uuid,'da58837d-05a9-4696-b725-ad2ee59d610f'::uuid,'"[{\"id\":\"def89f5f-45fe-4d8b-9a48-d6e3d9022a36\",\"content\":\"Budaya tradisional Indonesia orisinal dan kreatif.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"bc917be7-3bf0-4bd5-92ca-46d57fcf093b\",\"content\":\"Kebudayaan tradisional perlu dipertahankan.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"d2e1b83d-45bf-44b0-9040-c3bdb1be68c4\",\"content\":\"Globalisasi menggerus kebudayaan tradisional.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"99dd6272-2e83-4270-8a0d-bbfc26abd57e\",\"content\":\"Budaya gotong royong di Indonesia terkikis habis.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"55a5e1b5-4eaf-4fb2-b07c-c6c44c3fd647\",\"content\":\"Generasi muda mengidolakan budaya Barat.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('b8002d70-d754-49f0-9b05-ccd35309791d'::uuid,'a3209c52-dde8-4ca7-9134-1ab00ebe1dca'::uuid,'"[{\"id\":\"a5f14cb2-2d71-4e6f-8e92-6f131442ebce\",\"content\":\"Kali Cisadane dijadikan tempat kegiatan budaya agar warga peduli akan sungai.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"e250f216-b101-4740-b3f2-3f6a1d852934\",\"content\":\"Kali Cisadane menjadi tempat yang sangat menyenangkan bagi aktivis lingkungan.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"bb73c970-9f43-45de-8f8d-28b0bdff93b3\",\"content\":\"Kali Cisadane menjadi pusat kegiatan pergelaran seni budaya oleh komunitas peduli sampah.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"235d5030-2884-458d-bb5b-07e79cc515c8\",\"content\":\"Kali Cisadane merupakan salah satu sungai yang perlu mendapatkan perhatian khusus.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"3b89be57-053b-499e-826d-d3db08f938f4\",\"content\":\"Kali Cisadane harus dipelihara oleh semua pihak karena menjadi sumber kehidupan warga.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('0ad8ed7e-d734-41a6-b9f2-9172f433c597'::uuid,'c63a2827-9b87-4439-92f9-e87938be0260'::uuid,'"[{\"id\":\"246c57f6-13df-4bde-9268-600577444eec\",\"content\":\"Anak-anak yang belajar membaca pada usia \\\\( 3-5 \\\\) tahun akan mempercepat perkembangan otaknya.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"05468ac7-13eb-4467-b4d3-56bddf21ba68\",\"content\":\"Semakin awal kebiasaan membaca buku diperkenalkan, semakin aktif otak anak bekerja.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"dcdd7333-f053-4395-a052-0cf89d21c063\",\"content\":\"Anak-anak yang mulai belajar membaca sejak balita akan menjadi anak-anak yang otak kirinya lebih aktif.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"a9b533f4-5a76-4f6d-a660-e834bde90dbe\",\"content\":\"Kebiasaan mendengarkan cerita dan membaca sejak usia balita berdampak positif untuk perkembangan otak.\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"e717640d-259a-44c3-a95e-e2d755b0c360\",\"content\":\"Otak kiri bertanggung jawab terhadap proses pemahaman arti kata dan konsep.\",\"is_true\":false,\"key\":\"E\"}]"'),
