	 ('e4ec89b7-3896-463e-b5b1-35665a1a5fa6'::uuid,'88a78c15-669f-4027-855e-17c75be8448b'::uuid,'"[{\"id\":\"4e06ecf6-f9b7-459c-b873-a388bc66042c\",\"content\":\"Percepatan gravitasi menghilang selama orang itu jatuh bebas.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"bb8833d6-0af0-4b88-ad0c-c4270f0a64ba\",\"content\":\"Percepatan gravitasi yang dialami oleh orang dan oleh benda sama.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"2329fee9-74b6-4346-82fc-a23eedab8a4d\",\"content\":\"Orang dan benda selama jatuh bebas tidak memiliki bobot.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"9921f7f4-a478-4327-a072-7b44f74a3fc3\",\"content\":\"Orang itu tidak merasakan percepatan gravitasi selama jatuh bebas.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"1d7f304b-d5f8-4693-8982-55e28e901446\",\"content\":\"Orang itu merasakan kehadiran gravitasi meskipun di luar medan gravitasi.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('2c679a0d-3092-4153-85bd-0bbcc5eb4365'::uuid,'341e3c79-3b11-4ab2-8975-218181fcf8dc'::uuid,'"[{\"id\":\"5d00b602-9d90-4a71-93b8-91ccd2cbdb73\",\"content\":\"Komunitas peduli sampah\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"626655e5-4fc6-4b5e-ad89-020c2082d00f\",\"content\":\"Pengusaha peduli sampah\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"0233354b-ce79-48c0-82b6-4d077092f933\",\"content\":\"Warza yang tinggal di tepi kali\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"e6d4dacf-e93d-4987-a81e-9a5348f2cfdf\",\"content\":\"Aktivis peduli sampah\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"82897f38-4322-4048-b770-eb900d7faee7\",\"content\":\"Masyarakat penyelenggara festival\",\"is_true\":false,\"key\":\"E\"}]"');
