	 ('82e4131b-5f12-4e82-a442-698cd7445533'::uuid,'b425749b-5648-4f43-8bd9-589d0a193b5f'::uuid,'"[{\"id\":\"6502d8f7-aafa-4c3f-9619-32150b4badfc\",\"content\":\"Para joki Pacoa Jara merawat kuda-kuda yang kuat\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"7ff77802-aa5a-4cd8-a8b0-69f0c5a0d7d9\",\"content\":\"Pacoa Jara telah berlangsung turun-temurun\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"ca4b672f-a14f-476d-a47e-baed08a52dbb\",\"content\":\"Pacoa Jara biasanya diadakan untuk memeriahkan acara kenegaraan\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"afc3bc02-912d-473d-86b4-4de02c9ebf24\",\"content\":\"Sebelum bertanding, kuda dipersiapkan secara khusus\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"8b33ae26-53a6-4685-b1d1-1db347a78bf5\",\"content\":\"Pacoa Jara merupakan olahraga Ketangkasan joki dengan kuda-kuda yang kuat\",\"is_true\":false,\"key\":\"E\"}]"'),
