	 ('cc335c0f-b270-445b-b2f3-0af89d5d1985'::uuid,'9f395d1e-059b-4a76-9f45-fd604e5947ba'::uuid,'"[{\"id\":\"c9402bbd-5d00-4b11-8936-7a30b6434cf6\",\"content\":\"Pelaksanaan Pacoa Jara pada Hari Kemerdakaan RI\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"36d50d80-117e-428b-8a86-5f10eb6f0c1f\",\"content\":\"Antusiasme niasyarÃ¡kat terhadap Pacoa Jara\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"bcf44bbe-f5d3-4c04-a748-c4dedf1ce14a\",\"content\":\"Pengiriman kuda menuju tempat pacuan\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"b77fd023-52f2-4293-90ca-e3dd3192a754\",\"content\":\"Penyambutan hari-hari besar\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"8d8cf0eb-c008-4b2b-8f6f-dfd19c0dbeea\",\"content\":\"Pelaksaanaan Pacoa Jara\",\"is_true\":true,\"key\":\"E\"}]"'),
	 ('34f9952b-cb0b-4351-9d3c-35b0fe4c46fd'::uuid,'63cb91db-7c24-4880-874c-b7ea296afb40'::uuid,'"[{\"id\":\"7f45b02a-328f-4d0a-93e7-3b0dbce92e82\",\"content\":\"Pemerintah mengumumkan harga BBM baru itu tadi malam.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"c42f3a4c-fd6f-4f32-a682-32319f6e5be5\",\"content\":\"Perundingan itu akan berlangsung di Jakarta.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"9dcf4d3c-eebc-4179-8972-50beb518a80c\",\"content\":\"Dengan tegas, mereka menolak usul itu.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"7ab7cec6-13a8-4ea3-a4f3-d5cdea1561c3\",\"content\":\"Mereka bersedia mengalah demi keutuhan organisasi.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"9d72028d-8f47-4f4e-b3b6-a4f6c88ef4e0\",\"content\":\"Tanpa cukungan anggota, program ini tidak akan berhasil.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('2e364772-35d3-490f-8c55-7273d2728ea3'::uuid,'c6960773-d579-4f0a-857f-548952d5985e'::uuid,'"[{\"id\":\"e08441f1-de05-42b0-8f09-42b558167bee\",\"content\":\"upaya daur ulang dan penggunaan kembali botol plastik tidak berguna\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"86904073-29e4-4a4b-8220-4dc532a3c0d8\",\"content\":\"botol plastik mengandung zat kimia Bisphenol\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"f75ed3da-59fe-42fa-a7eb-cec2aee66839\",\"content\":\"penggunaan plastik dapat menimbulkan masalah\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"30daf1f3-d487-4314-a305-d78544fc3f72\",\"content\":\"botol plastik dapat menimbulkan efek negatif bagi kesehatan tubuh\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"bfe6ecfc-463c-4f1f-88d2-f86e03a9d512\",\"content\":\"dampak negatif penggunaan botol plastik\",\"is_true\":false,\"key\":\"E\"}]"');
INSERT INTO public."options" (id,question_id,"options") VALUES
	 ('53a80ef3-05c3-4d20-91e4-3a0fd6c97768'::uuid,'06d7c4f7-f8e9-42f8-b3a6-70b5fa75b423'::uuid,'"[{\"id\":\"cd27f34e-d227-4d58-a6a3-abe259f6368f\",\"content\":\"Menurut Ibrahim bahwa dalam situasi percakapan itu bukan semata-mata menyampaikan tuturan, tetapi juga melakukan tindakan.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"0f0b2bd4-142e-4400-b094-ae3bd631a743\",\"content\":\"Menurut Zubaidi, dalam mengenali sikap seseorang diperlukan perhatian yang penuh dan tulus terhadap sikap dan tutur katanya.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"edd45def-a493-4e88-8fec-bf40024412c7\",\"content\":\"Menurut Kamus Besar Bahasa Indonesia, khususnya halaman 59, menjelaskan santun berarti ''serba rapi''.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"7ce23a25-3e4d-4c3a-af32-9291d4569dec\",\"content\":\"Menurut Darmanto, dijelaskan bahwa dalam bermain drama diperlukan rutinitas latihan secara serius, tidak sekedar hafal naskah.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"f46247e2-fd2b-44a5-902d-33495a1258f3\",\"content\":\"Menurut Zidan, dalam bukunya yang berjudul Menggapai Sukses, untuk prestasi yang tingg memerlukan kerja keras dan cermat.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('c536b9e2-7ec2-43fe-9f21-348e550b1fd2'::uuid,'4970f888-5779-40f0-ac68-192ac84e4c75'::uuid,'"[{\"id\":\"9fa2f65f-d0cb-4e09-8b3e-4fb2e866ce9e\",\"content\":\"Konsep \\\"anggaran air\\\" diciptaan oleh para ahli hidrologi untuk mengukur kebutuhan air di suatu negara\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"00b95067-f2c2-49ba-be94-07c06e5ac9cc\",\"content\":\"Kelngkaan air di suatu negara terjadi jika kebutuhan air warga negaranya kurang dari 500.000 liter per tahun\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"c217e74f-6243-4fb3-b0e2-fa266cd176b5\",\"content\":\"Air yang masuk ke suatu kawasan yang berasal dari sunga, air terjun, air tanah, dan sumber buatan dimanfaatkan penduduk untuk kebutuhan hidup sehari-hari\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"f41c9479-a09d-4ecd-9454-8414e3eeda28\",\"content\":\"Kebutuhan air suatu kawasan diukur dengan mengurangi jumlah air masuk dengan jumlah air keluar, lalu dibagi dengan populasi di kawasan tersebut\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"a69e6218-c967-4d85-9bb6-e4e909d0e08e\",\"content\":\"Memadainya jumlah ketersediaan air di suatu kawasan bergantung pada kebutuhan air warganya untuk kebutuhan sehari-hari\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('001209e2-a7b6-4a88-b934-ce3a84b2769c'::uuid,'1e33abe5-118a-4313-9db9-ec15132eec35'::uuid,'"[{\"id\":\"690b20ee-ca9f-48ac-8d80-6d0c953a44df\",\"content\":\"Tugas pemerintah bukan hanya mengendalikan jalannya pemerintahan, tetapi juga membangun masyarakat dalam rangka menciptakan keadaan yang lebih baik.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"23fd0fbc-2529-4b7e-8dec-6873ada13add\",\"content\":\"Tugas seorang guru bukan hanya mengajarkan ilmu pengetahuan, tetapi juga mendidik kepribadian murid agar memiliki mentalitas yang maju.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"5df0f533-850a-419e-b1f6-214800adbdca\",\"content\":\"Kesukaannya bermabuk-mabukan sudah sampai pada tingkat yang kronis hingga mengantarkannya ke liang lahat.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"0840b1c2-f820-4036-a8ab-92c94e6c7c2f\",\"content\":\"Mencintai itu tidak hanya diwujudkan dengan kata-kata, tetapi juga hanus dibuktikan dengan keberanian untuk menikahinya.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"c6bcf35b-9e33-40f3-8430-e02925f4f45f\",\"content\":\"Balon itu dipompa hingga menggelembung besar sekali, kemudian meletus.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('4122ad79-7e23-451a-ae23-9e7f4e24349c'::uuid,'87579b8e-cbfb-4728-91c8-ec8fb08f4dd2'::uuid,'"[{\"id\":\"56a1ef86-999c-4fe0-80a1-776a724c093d\",\"content\":\"Di dasrah pedalaman banyak membutuhkan tenaga SMP dan SMA.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"7ed0b752-77b8-4c06-acdc-3c76856f4160\",\"content\":\"Gembong pemberontak itu berhasil diringkus oleh aparat keamanan.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"435fb6a0-3b38-4b57-8976-f7f9dd4f3c97\",\"content\":\"Jika melalui gang ini, naik kendaraan bermotor diharap turun.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"fcd027f7-8561-4780-9e9d-514fae68b671\",\"content\":\"Yang merasa kehilangan kartu ujian dapat mengambilnya di sekretariat.\",\"is_true\":true,\"key\":\"E\"},{\"id\":\"08f69f3a-284e-41cf-b131-1ebc50af3e71\",\"content\":\"Masalah itu minta diselesaikan sampai tuntas agar tidak menjadi beban.\",\"is_true\":false,\"key\":\"C\"}]"'),
	 ('2f90290f-c20d-4d3f-a9d9-83e08379c79a'::uuid,'8a5b2c86-e02c-4764-bb65-42b56fb320e1'::uuid,'"[{\"id\":\"9a47d698-fe66-4f0b-b3a4-0f63786ae16d\",\"content\":\"Jerjak diterjang banjir.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"05a9a470-e40e-40ea-a008-dafa1efaed29\",\"content\":\"Jembatan-ambruk.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"921b3ef4-366d-41d5-b374-72a7f9915fca\",\"content\":\"Jerjak ambruk.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"bf164199-cee8-404c-a6a4-08ee46470fba\",\"content\":\"Sungai mengalir.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"38cba319-1395-461b-ba31-3f2941c8db81\",\"content\":\"Sungai banjir.\",\"is_true\":false,\"key\":\"E\"}]"'),
