	 ('b74b7bd2-2c06-48a5-8f04-9f0a4a178132'::uuid,'db47c7f9-cdcb-4dbd-997a-c12ec84a9ca5'::uuid,'"[{\"id\":\"47406398-ecf7-412d-a862-79fce6ba3848\",\"content\":\"Makalah ini menggali ekspresi seni.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"cacc807c-6e88-49ad-ae05-838963f6fb44\",\"content\":\"Ekspresi seni sebagai produk.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"ea7a573e-a7dc-424e-9c60-d308281340a4\",\"content\":\"Makalah berusaha menggali.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"6ac1d982-c1fc-4efc-9d04-4d71eba91c04\",\"content\":\"Kekuatan ekspresi seni disepakati.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"e4bc1b28-734e-4542-9374-c73c3efc191a\",\"content\":\"Ekspresi seni mempresentasikan identitas.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('44f0c9d8-6b68-4ee5-84f0-dba7f0b45c96'::uuid,'cc4eb5f0-fc9a-44a7-ade9-00ed853eb523'::uuid,'"[{\"id\":\"7afa35ce-5af8-42ea-8cce-912187bc331f\",\"content\":\"Pengambilan kebijakan tidak sesuai dengan kondisi daerah\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"3d1f9d43-f86a-464b-91d7-456e81a55799\",\"content\":\"Persebaran kepadatan penduduk selalu dalam kondisi tidak merata\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"0250e200-da2b-4c41-8252-6c95928d57f9\",\"content\":\"Persebaran penduduk tidak merata dan pertumbuhan jumlah cepat\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"77f1ae2d-0da6-4b59-90ad-705944e6466b\",\"content\":\"Pembangunan tidak menjangkau semua wilayah yang berpenduduk\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"da2382b3-329a-48cf-9fc6-d2098aaa2fd2\",\"content\":\"Aktivitas pembangunan tidak pernah menggapai setiap individu\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('cd01bcb7-bf4a-41e7-b96f-05a24cca43fb'::uuid,'7b126517-f9fc-4ab8-b657-e38a9d0431db'::uuid,'"[{\"id\":\"ccb49ea5-b043-4507-95ca-e8641ca6c454\",\"content\":\"the last sentence of paragraph 1\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"cfec5652-934c-470c-9ea7-0cd7c5a2913b\",\"content\":\"the last sentence of paragraph 2\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"4801debb-5546-4f05-99c2-b1e9ca88421d\",\"content\":\"the last sentence of paragraph 3\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"08161ed3-0e9b-400d-9e5f-02f32567a978\",\"content\":\"the last sentence of paragraph 4\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"bbaf3f05-84fe-4816-b2a1-56a86d4520f2\",\"content\":\"the last sentence of paragraph 5\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('20f19a05-1e65-4f17-9882-5f0167bfdf7e'::uuid,'113f45da-7db4-4149-bad3-6815100ddc35'::uuid,'"[{\"id\":\"2eb4b2f1-8df7-44ee-9df5-53ea7abd45fb\",\"content\":\"Menghilangkan kata untuk pada kalimat pertama.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"12fe5c5e-27f6-4199-900d-a9a52c2ad208\",\"content\":\"Mengganti kata dari pada kalimat kedua dengan kata pada.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"599e496b-0ed9-4fd9-8819-1a8a35c05a0d\",\"content\":\"Mengganti kata dari pada kalimat ketiga dengan kata oleh.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"9c191272-1419-44fb-af92-6ca56a700227\",\"content\":\"Menambah kata yang setelah kata para pelayan dalam kalimat ketiga.\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"3dd7558c-32e8-415d-accf-6d8190a09635\",\"content\":\"Menghilangkan kata dari setelah kata kinerja dalam kalimat keempat.\",\"is_true\":false,\"key\":\"E\"}]"');
