	 ('4262aa47-0040-4d5d-a805-48e49d89bd9b'::uuid,'e1e1e35d-5f44-4b6d-a42c-b90d2fa12952'::uuid,'"[{\"id\":\"dfca2903-334b-4780-9a58-ad1567850981\",\"content\":\"Sehubungan dengan akan diberlakukannya undang-undang hak cipta, maka setiap pengusaha fotokopi harus berhati-hati.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"3a4c7392-bb5f-4a79-9c94-82cd9d0b9000\",\"content\":\"Perusahaan bukan bermaksud untuk mem-beratkan karyawannya, melainkan untuk menyelamatkan aset yang dimilikinya.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"b9e51999-b98a-44d6-af9c-c4dd1aa4ef5e\",\"content\":\"Walaupun sudah dilakukan pendataan se-cara cermat, masih ada keluarga miskin yang belum terdaftar untuk mendapatkan bantuan.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"9ea2adb4-afb6-4550-b177-97c2b5053ee8\",\"content\":\"Karena kurangnya koordinasi antarpihak penentu kebijakan, semua peraturan yang dibuat selalu menimbulkan masalah.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"011d7872-84fb-48a4-a38c-fc9227391a86\",\"content\":\"Jika para manajer perusahaan itu tidak se-gera menyatukan visi dan misinya, perusa-haan tersebut akan hancur.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('34de2737-1e60-4723-9d97-9a8764ae6281'::uuid,'801caf95-f795-436f-b1b6-537c82e6ffbc'::uuid,'"[{\"id\":\"2158398d-d7db-4098-8835-94bcda15a7f7\",\"content\":\"Menambahkan kata maka sebelum kata sangat\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"99eab3e7-8f5e-4a1f-98bd-1cf0e9288d52\",\"content\":\"Menambahkan kata dalam sebelum kata menjawab\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"4f4b1fa1-0444-48ae-93ae-3b19078b2b71\",\"content\":\"Mengganti kata dalam dengan kata untuk\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"ec15e479-6409-4c55-902d-9903e02f429f\",\"content\":\"Menambahkan kata pada sebelum kata pasar\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"c4942163-32af-4ee3-95ac-c4a5d1b73c26\",\"content\":\"Mengganti kata komplek dengan kata kompleks\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('12011cb2-faf6-4096-a56c-76809fa6543b'::uuid,'bd65c602-bf7b-4686-a4c2-bc4a30f5385f'::uuid,'"[{\"id\":\"062342f8-31cb-4c9d-b795-1fb2f4a1e35f\",\"content\":\"Perkembangan penggunaan varietas padi ketan unggul lambat.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"f9e7efeb-f351-49dd-9233-2ef3284bd219\",\"content\":\"Banyak petani yang belum mengetahui varietas padi ketan.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"56cf8949-5de9-49d1-ae78-18553117897d\",\"content\":\"Lambatnya penyampaian informasi, dan iklim usaha beras ketan belum mendukung.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"9698eadf-668e-492f-b5a1-85547a29b2d3\",\"content\":\"Rendahnya angka serapan pemanfaatan penggunaan varietas padi ketan unggul.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"cc14c782-77b6-4df7-be07-4a8a66cda289\",\"content\":\"Hasil penelitian menunjukkan lambatnya perkembangan penggunaan varietas padi ketan unggul.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('d238bfc9-6134-40ed-8380-add126d3e8f6'::uuid,'4fc6a82b-a087-4f5e-86ae-e214328da3c5'::uuid,'"[{\"id\":\"1bfbcca6-b8c5-4167-87d6-ff4dbc2bf26c\",\"content\":\"Di Indonesia sekarang ini sedang giat mengadakan pelatihan untuk peningkatan kualitas pembelajaran.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"3ad5e161-746c-48f9-b9ae-58d28b1f8eb1\",\"content\":\"Berdasarkan uraian di atas menunjukkan pentingnya pendidikan emosi bagi orang dewasa.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"e340d0c2-7057-4075-ba54-3e98ada79fd4\",\"content\":\"Dengan penelitian ini dapat meningkatkan kualitas pembelajaran di sekolah terpencil.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"31b74aaa-b8c9-47fa-b13a-c5a409be375b\",\"content\":\"Di Kalimantan terdapat binatang langka yang kehidupannya nyaris punah karena kebakaran.\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"3ef807a6-d5f5-48cb-ab22-2a8c296e1e34\",\"content\":\"Dengan menggunakan pupuk tablet dapat menghemat biaya tanam mencapai \\\\( 50 \\\\% \\\\).\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('8466a41f-281e-49fe-b621-cb1ed4623e72'::uuid,'6d56d4df-2396-409e-a644-6a004b6f3e04'::uuid,'"[{\"id\":\"703d9c43-cfc0-49bf-b2b0-482c0b48d9b2\",\"content\":\"asyik\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"6bb6ba4f-081c-4f17-b5a4-b289d8581fe4\",\"content\":\"ramai\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"3c4841d9-0919-4191-a5dc-d6b1c8c92b52\",\"content\":\"ramay\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"3169c500-0429-4dd9-9c39-6bccde155331\",\"content\":\"heboh\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"8b94d84a-796f-44b2-935a-681399404da0\",\"content\":\"viral\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('e850fa60-38aa-4eb7-828f-da8b8f358a68'::uuid,'5c7848e6-4ff6-41b0-84b1-12d6fb4a7e97'::uuid,'"[{\"id\":\"0523c824-dd28-41e4-93d2-b646655374f4\",\"content\":\"Lingkungan fisik Indonesia terdiri atas daerah-daerah.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"504a1609-3273-40d2-a7ea-191184ec75d9\",\"content\":\"Lingkungan fisik Indonesia terentang dari Sabang sampai Merauke.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"66a6844a-f218-4aba-8f2f-36487e9b3b09\",\"content\":\"Daerah-daerah tertabur menjadi beribu-ribu pulau.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"067c9f8e-1568-481c-9c97-1b95faf1dd18\",\"content\":\"Lingkungan fisik Indonesia berpengaruh pada praktik sosial.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"419c2f62-99c6-4a40-9bf5-72ddce3a4f73\",\"content\":\"Praktik sosial berupa perilaku bermasyarakat.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('87e69353-62ab-411c-9e3c-6d942611e1b5'::uuid,'64db64f7-7587-4ec7-9f69-71fab342e040'::uuid,'"[{\"id\":\"09e86566-4b1b-4663-9c18-ff4ecb5fd6f5\",\"content\":\"Pernyataan 1 adalab penyebab dan pernyataan 2 adalah akibat\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"74662a1e-d624-4319-8379-2eb3529d11eb\",\"content\":\"Pernyataan 2 adalah penyebab dan pernyataan 1 adalah akibat.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"96af295a-71ec-45d0-a1b2-b9abed870c44\",\"content\":\"Pernyataan 1 dan 2 adalah akibat dan dua penyebab yang tidak saling berhubungan.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"b0de5dd2-bb3e-4182-b6c8-4457bd60cb9e\",\"content\":\"Pemnyataan 1 dan 2 adalah akibat dari suatu penyebab yang sama.\",\"is_true\":false,\"key\":\"E\"},{\"id\":\"8f23273b-c0cd-4fef-8a4a-2fca79c821ab\",\"content\":\"Pernyataan 1 dan 2 adalah penyebab, namun tidak saling berhubungan.\",\"is_true\":false,\"key\":\"C\"}]"'),
	 ('a149f762-7c06-4a4e-98cd-6bd0f45ddd17'::uuid,'b4c1c44c-8bd6-4260-b44e-009c8bff234a'::uuid,'"[{\"id\":\"a0ba53c8-c8b0-4aa3-a112-1d9ad2933e0c\",\"content\":\"Proses perubahan mekanisme kerja dalam industri untuk membuat hasil lebih banyak\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"4d6089e4-210c-47dc-b2c3-89b96affd383\",\"content\":\"Perubahan teknologi kerja yang dilakukan perusahaan untuk meningkatkan efisiensi\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"f1f29e16-77bb-4404-b596-67e6cd571e3f\",\"content\":\"Proses perubahan kerja yang dilakukan perusahaan agar pekerjaan lebih terstruktur\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"fa5be2d9-3f0f-4d0a-af5b-e294df62b946\",\"content\":\"Penggantian pekerja di dalam industri dengan mesin untuk mengatur pekerjaan lebih cepat\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"528885d0-d9bf-4cb2-913c-472fa0a994b9\",\"content\":\"Peningkatan penggunaan kecerdasan artifisial dalam penggunaan mesin produksi\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('b1544707-5e51-4e42-8387-366f4a4496c5'::uuid,'da61f621-0b41-4387-832e-c4d8d025d9f3'::uuid,'"[{\"id\":\"98606dbb-7c50-41f5-a799-932422f5f1f4\",\"content\":\"Paragraph 4 explicates Continental''s sense of optimism provided in the last sentence of paragraph 3.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"7cbc9121-e799-4d3b-89ac-f1dcd7dc2ecc\",\"content\":\"The sentence states Philipp Hoffman''s idea about eliminating drivers in cars and the following paragraph elaborates the idea.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"91b128b8-2e4b-4572-91da-6eb4f8fca9f8\",\"content\":\"The last sentence of paragraph 3 describes the regulation in implementing the technology in the U.S. and the following paragraph elaborates it.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"2c42d9a5-7a90-4453-9f0a-c6ca6f4af827\",\"content\":\"Paragraph 4 provides examples to support the idea ajout the implementation of Mercedes-Benz technology mentioned in the previous sentence.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"ebb67038-790a-44a4-8ce3-fedd2b0e3424\",\"content\":\"The sentence discusses the possibility for the technology to be implemented in the U.S. and the following paragraph explain the reasons for the possibility.\",\"is_true\":true,\"key\":\"E\"}]"'),
	 ('4153aaa0-c65f-46aa-a745-8623725a9f19'::uuid,'21edabaa-99a6-4361-a08e-764461dc6d83'::uuid,'"[{\"id\":\"899e60c0-7601-4e06-852f-fa18c26da1ff\",\"content\":\"Kecenderungan pengunggahan dan pendistribusian informasi melalui media sosial mempercepat limpahan dan kompleksitas informasi\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"df229035-b1b5-4bf6-8a93-b48c7391ecfb\",\"content\":\"Kompetisi antarsitus dalam meningkatkan jumlah kunjungan dilakukan dengan menawarkan sajian informasi atraktif\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"256b670f-117a-4fa2-b480-d6b57f24e463\",\"content\":\"Kondisi keberlimpahan informasi membingungkan pembaca untuk membedakan tingkat validitas suatu informasi\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"4f5d7ba7-5dce-4ecd-95d0-5de702aa6bc9\",\"content\":\"Usaha menyaring berbagai informasi dan mendapatkan intisarinya merupakan tantangan terbesar di era informasi ini\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"b49f538d-2735-4caa-8ea9-7c43f158aa42\",\"content\":\"Kegiatan menyaring informasi merupakan usaha memilah informasi valid/tidak valid dan hoaks atau tidak hoaks\",\"is_true\":false,\"key\":\"E\"}]"');
