	 ('16dfb70b-0c40-413e-b077-37e430306176'::uuid,'4cd766dc-0250-4bf5-be5e-2a37063da58a'::uuid,'"[{\"id\":\"52ae446e-830a-4f2d-a729-04ab366358ce\",\"content\":\"Setiap bangsa yang memiliki bahasa akan selalu menggunakan bahasanya itu untuk berkomunikasi dalam kehidupan bermasyarakat.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"f693df0f-129a-4929-8141-a3b97c440c88\",\"content\":\"Setiap bangsa memiliki bahasa dan setiap bahasa sendiri dimiliki dan dijunjung tinggi oleh masyarakatnya.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"50af9213-c164-4ad7-9fbe-8d894852e13a\",\"content\":\"Hampir dapat dipastikan bahwa tidak ada bangsa di dunia ini yang tidak memiliki bahasa.\",\"is_true\":false,\"key\":\"E\"},{\"id\":\"0ba79ad5-b440-491f-ae8a-821a27b38b2d\",\"content\":\"Setiap bangsa yang ada di dunia ini memiliki dan menggunakan bahasa yang terus berubah sejalan dengan perubahan zaman.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"62098a2d-1a7a-49ae-a970-15e58a3bb1dd\",\"content\":\"Dalam kehidupan berbangsa dan bernegara, setiap bangsa harus memiliki bahasa sebagai sarana pengembangan budaya.\",\"is_true\":false,\"key\":\"D\"}]"');
