	 ('cb6d8ff3-8fc2-4bbe-92d1-18083bf8d3ff'::uuid,'37a50148-4cf6-460f-a945-58cede1b753c'::uuid,'"[{\"id\":\"3ccae669-334e-4006-81a6-0ff187f17265\",\"content\":\"Astronaut yang melakukan perjalanan ke Mars berisiko terkena kanker dua kali lebih tinggi karena adanya radiasi kosmik.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"9400cdae-12c4-466d-a8e4-369093a13645\",\"content\":\"Risiko kanker yang akan dialami oleh astronaut yang melakukan perjalanan ke Mars menjadi lebih tinggi akibat adanya efek turunan yang sulit dihindari.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"9087ca96-f998-46d2-a9c6-c18ebdc490ad\",\"content\":\"Perbedaan utama perhitungan risiko kanker pada model lama dan model baru dalam perjalanan ke Mars terletak pada kemungkinan kerusakan berat pada sel.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"07d72e9e-6068-4a34-8518-e95c9ff11401\",\"content\":\"Penelitian telah menemukan bahwa perjalanan ke Mars berisiko tinggi bagi para astronaut dengan adanya kemungkinan terkena serangan kanker.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"586a1995-5ef6-4a27-a94d-b7a7971164f8\",\"content\":\"Perjalanan ke Mars meningkatkan risiko astronaut terkena kanker dua kali lebih tinggi karena adanya koreksi perhitungan risiko kanker pada perjalanan ke Mars pada model lama.\",\"is_true\":true,\"key\":\"E\"}]"'),
	 ('2dd1d7ec-6fab-4956-835d-081999c3a69a'::uuid,'0d87d190-f93e-4469-ac39-2df5109a3869'::uuid,'"[{\"id\":\"7666bbfc-ce0c-4986-bd87-180d839eccc7\",\"content\":\"Misi luar angkasa bisa berdampak pada ketahanan mental para astronaut yang bertugas.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"71ef8fbc-b09c-48ec-b58b-913d1597dc45\",\"content\":\"NASA memperketat sistem perekrutan astronaut untuk mencegah gangguan selama misi luar angkasa.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"8f38aac9-aff2-46bd-8e46-8c881ae9128e\",\"content\":\"Observasi ketat telah dilakukan NASA pada masa persiapan dan pelaksanaan misi luar angkasa.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"57f0a64e-70f6-4714-9a63-6aeccd4bcf76\",\"content\":\"Ketegangan antarawak di Stasiun Luar Angkasa Internasional terjadi karena insiden penemuan lubang kecil di pesawat.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"4b508fb4-ae69-492c-9356-21c495cf5e25\",\"content\":\"Masalah psikologis astronaut kini telah menjadi perhatian khusus NASA sehingga penyaringan calon astronaut berlangsung ketat.\",\"is_true\":false,\"key\":\"E\"}]"'),
