	 ('cd09e2f9-4f5a-457b-af55-8d9a0ec7085e'::uuid,'1669827c-cfdf-477b-bfca-d335d496e461'::uuid,'"[{\"id\":\"f9da9e0b-501d-4f94-b96c-da19fdcec02d\",\"content\":\"Kedua kata itu menunjukkan pertalian bentuk dan makna sehingga mempermudah penutur jadi memahami keduanya dengan baik.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"f9de3340-0be8-43bb-813e-2d6c6836a86e\",\"content\":\"Laman ini memuat pelajaran untuk siswa SD seperti matematika, bahasa Indonesia, IPA, IPS, dan sebagainya.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"f53b4ba2-e0bf-4308-8e80-7820540059d1\",\"content\":\"Sebanyak tiga kapal berbendera negara asing terpantau sedang melakukan aktivitas di perairan tersebut.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"59d70744-c85b-4f4a-98f1-c62c0522c490\",\"content\":\"Hasil penelitian menunjukkan bahwa persuratkabaran pada masa reformasi berbeda dengan masa sebelumnya.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"8f40275e-0045-4480-90a2-6b95266af2a1\",\"content\":\"Setiap pelabuhan pasti dapat mendorong kemajuan di sektor maritim khususnya perkapalan.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('79a0706c-93fe-45b8-ab9f-7b70da6d96ae'::uuid,'25e0c460-cc2e-437b-b3a7-c08d371965f9'::uuid,'"[{\"id\":\"c76a43e2-4d74-4195-8d4f-2890ea49b451\",\"content\":\"kalimat (6)\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"dbc147fb-4674-4def-b5bd-0dbc5154ecee\",\"content\":\"kalimat (8)\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"8d27e15a-0448-403c-b655-0ff72ad7d8f5\",\"content\":\"kalimat (10)\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"a251b800-84c9-49b1-8f9e-28498bcbbf22\",\"content\":\"kalimat (11)\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"02dec491-6d59-4a78-a672-3b9e7078d0d6\",\"content\":\"kalimat (12)\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('7179518a-9f3a-4a0a-a7cb-d20c334531e1'::uuid,'d49b24e6-b479-4ea9-9cfd-1820e1b03569'::uuid,'"[{\"id\":\"a10786f9-acfa-4266-9f91-64788ef76510\",\"content\":\"pemahaman akan bahaya limbah sedotan plastik di Bali sebagai daerah wisata yang paling banyak dikunjungi tamu manca negara menjadi alasan mengapa sedotan pakai ulang menjadi popular\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"414c9931-7a76-4043-9471-77cad315afe4\",\"content\":\"Bali memiliki kunjungan tamu asing dalam jumlah sangat besar dan ini mendukung kebiasaan menghindari bahaya limbah sedotan plastic\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"3557ae30-de58-42d2-ac1a-387748bc8f2b\",\"content\":\"asumsi tamu wisatawan asing mengenai bahaya limbah plastik di Bali telah mendorong munculnya solusi berupa sedotan pakai ulang\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"f755fea3-8f6d-4459-aba5-443c3c2d13a2\",\"content\":\"kesadaran yang tinggi di kalangan para wisatawan manca negara yang banyak mengunjungi pulau Bali membuat mereka menolak diberi sedotan plastik sekali pakai\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"41e0835b-9938-44bb-9133-e3cc5fbea6eb\",\"content\":\"di Bali, kesadaran masyarakat akan bahaya limbah plastik telah mendorong maraknya pemakaian sedotan pakai ulang saat para tamu dari luar negeri menolak diberi sedotan sekali pakai\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('e8853ee2-70dd-47aa-98d4-19ffb8b401d8'::uuid,'49822fa8-8de4-4db5-8801-71b1caab8add'::uuid,'"[{\"id\":\"f9a47a98-834c-49b7-a288-732ba3edd640\",\"content\":\"Pelatihan wirausaha tanpa modal dapat meningkatkan angka pengangguran di suatu negara\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"3f4e198f-422e-4b16-bc50-75b90766d44c\",\"content\":\"Suatu negara memiliki angka pengangguran tinggi karena melakukan pelatihan wirausaha tanpa modal\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"33cb9739-7228-4cc5-8286-4249c9187bec\",\"content\":\"Negara yang memiliki sedikit peluang pekerjaan memiliki program pelatihan wirausaha tanpa modal\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"29e0df36-7a57-427f-8695-4132a7da3348\",\"content\":\"Negara yang tidak melakukan program pelatihan wirausaha tanpa modal memiliki tingkat pengangguran yang rendah\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"657cffa5-a5bb-4260-bb44-ae91228b979b\",\"content\":\"Penurunan tingkat pengangguran suatu negara dapat dilakukan dengan pelatihan wirausaha tanpa modal\",\"is_true\":true,\"key\":\"E\"}]"'),
	 ('345a5cc8-86a9-4c1f-85be-9edb39ca8f89'::uuid,'ad586654-0e15-4279-b2ba-489d2d325844'::uuid,'"[{\"id\":\"224018ee-467a-40b8-837c-559005ae2966\",\"content\":\"Sebagian yang datang ke Patena melalui jembatan Torosi.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"2096bc72-0cd5-40c7-941f-f9701f11f195\",\"content\":\"Sebagian yang pergi ke Timbuktu melalui jembatan Torosi.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"31d58186-9d33-4fa8-aa90-1f5b9f99d900\",\"content\":\"Semua yang melalui jembatan Torosi tentu bepergian ke Timbuktu.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"c7a83718-45ef-477d-b423-10b11c340890\",\"content\":\"Semua yang bepergian ke Timbuktu harus melalui jembatan Torosi.\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"2d2a3597-080f-4f56-afd9-c94f7257b310\",\"content\":\"Semua yang tidak bepergian ke Timbuktu tidak melalui jembatan Torosi.\",\"is_true\":false,\"key\":\"E\"}]"'),
