	 ('da4f2c91-223d-4e62-af1c-a5ca2c71dd43'::uuid,'7f6389df-5499-4c71-9834-ab81bdefcda9'::uuid,'"[{\"id\":\"c39fab39-4017-4151-a96b-5b1ada08eda2\",\"content\":\"Sebagian montir yang memiliki keterampilan memperbaiki kendaraan berat dapat memperbaiki kendaraan jenis truk.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"2f00052f-f9c5-4f97-9b0d-5a6b57f0db6b\",\"content\":\"Sebagian montir yang bekerja di Perusahaan Otomotif \\\\( \\\\mathrm{X} \\\\) mampu mengendarai truk lebih baik dari montir yang lain.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"d2cb98e5-871f-4354-bd69-cb7c3f51e08c\",\"content\":\"Sebagian montir yang bekerja di Perusahaan Otomotif \\\\( X \\\\) memiliki keterampilan memperbaiki kendaraan berat.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"5e72c617-4e91-45c2-a778-d6f84d17d8f2\",\"content\":\"Sebagian montir yang memiliki keterampilan memperbaiki kendaraan berat tidak mampu mengendarai truk lebih baik dari montir yang lain.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"99db07bc-1715-4f52-b27d-fe4f6edda447\",\"content\":\"Sebagian montir yang memiliki keahlian dalam memperbaiki kendaraan jenis truk bukan montir yang bekerja di Perusahaan Otomotif X.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('d5158cbe-2293-4e35-8127-f8cf7364e6df'::uuid,'e3f4d4a6-4551-4d4d-82f2-99fd7cd755cd'::uuid,'"[{\"id\":\"b88f6b10-c4fb-41d6-b2eb-2e1d851abca8\",\"content\":\"Simpulan tersebut pasti benar.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"f7ecfca0-8f8d-4514-9286-c86fc80b702c\",\"content\":\"Simpulan tersebut mungkin benar.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"5c21b172-9615-4779-92c7-628d12d8d6fb\",\"content\":\"Simpulan tersebut pasti salah.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"018a1363-7425-4401-9949-1bd2450811d8\",\"content\":\"Simpulan tidak dapat dinilai karena informasi tidak cukup.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"da44f019-3a42-4d23-9f0f-2159648e1dd0\",\"content\":\"Simpulan tidak relevan dengan informasi yang diberikan.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('2d43040d-813c-41aa-94a4-4e4470d80ea6'::uuid,'13a4068a-767c-42b7-b99a-bc9101b32ee7'::uuid,'"[{\"id\":\"44503cc7-4115-4cd7-b2b3-8009a4c3fccc\",\"content\":\"Sebagian akuntan yang memiliki pengalaman bekerja di luar negeri tidak berminat untuk bekerja selain di kantor akuntan.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"20e0f765-d1ed-4881-8002-554e22d3eef8\",\"content\":\"Sebagian akuntan yang bekerja di kantor akuntan \\\\( \\\\mathrm{X} \\\\) berpeluang mendapat tawaran tinggi untuk pindah ke perusahaan keuangan.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"4ff2a792-c86a-449d-b563-830df1eb18a1\",\"content\":\"Sebagian akuntan yang pindah kerja di lembaga pemerintahan bukan akuntan yang bekerja di Kantor Akuntan X.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"46293da6-748c-4127-841b-c4121425531f\",\"content\":\"Sebagian akuntan yang bekerja di kantor akuntan \\\\( \\\\mathrm{X} \\\\) adalah akuntan yang memiliki pengalaman kerja dari luar negeri.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"c90c47ad-500a-4ed7-a214-f168964990a5\",\"content\":\"Sebagian akuntan yang memiliki pengalaman kerja dari luar negeri kurang berpeluang untuk mendapat tawaran pindah ke perusahaan keuangan.\",\"is_true\":false,\"key\":\"E\"}]"');
