	 ('64b3f474-1b71-4b30-8bf3-26dc1494a99b'::uuid,'9becad08-148d-4189-a6d7-815fa7ff2d78'::uuid,'"[{\"id\":\"cdf28d2d-365e-4ed5-b78a-510f92d51a32\",\"content\":\"Sejak dahulu, minuman herbal sangat disukai oleh berbagai lapisan masyarakat\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"c759a6d4-a21a-4d0a-85f3-afa23e92d6c4\",\"content\":\"Secara umum, semua jenis tanaman obat juga mengalami peningkatan permintaan\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"a1516d96-b011-43a3-9bca-ba6038032241\",\"content\":\"Jumlah pembuat minuman herbal pada triwulan ini lebih banyak dibandingkan triwulan lalu\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"caa2dafe-6973-44ab-b187-ab141fdb97f9\",\"content\":\"Dari dahulu, konsumsi jahe selalu tinggi karena banyak produsen minuman herbal\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"cdabc77f-3a7e-4582-8934-2bc923750571\",\"content\":\"Produksi komoditas jahe pada daerah A setiap periode selalu meningkat\",\"is_true\":false,\"key\":\"E\"}]"'),
