	 ('0dd1d571-0ddd-4216-b3a9-e5fda864d1f3'::uuid,'ca1f0b0d-ef8e-4121-a970-5a051af83def'::uuid,'"[{\"id\":\"71c9270e-6e48-49a9-aded-78ba6874257d\",\"content\":\"X tidak menghadiri acara makan malam di kantor atau \\\\( X \\\\) pergi ke bandara diantar ayah\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"28a905d8-bb7d-445e-9d08-41d7548fbee1\",\"content\":\"\\\\( \\\\mathrm{X} \\\\) menghadiri acara makan malam di kantor atau \\\\( X \\\\) tidak pergi ke bandara diantar ayah\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"25020165-077d-469b-b930-2bd694472aa4\",\"content\":\"X menghadiri acara makan malam di kantor, tetapi \\\\( \\\\mathrm{X} \\\\) tidak pergi ke bandara diantar ayah\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"65cfee80-a565-4350-ace2-174f2bfa710c\",\"content\":\"X menghadiri acara makan malam di kantor dan \\\\( \\\\mathrm{X} \\\\) tidak pergi ke bandara diantar ayah\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"ce2de9f4-1f1f-43e0-8f2f-3d20476f9218\",\"content\":\"\\\\( \\\\mathrm{X} \\\\) tidak menghadiri acara makan malam di kantor dan \\\\( \\\\mathrm{X} \\\\) pergi ke bandara diantar ayah\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('6b3e4520-d10e-46bf-afd2-ba672d11f9f3'::uuid,'27b3968d-7ce1-4c55-b35b-4ca9b1a8b5c9'::uuid,'"[{\"id\":\"bb12a364-fd79-4fe9-85cb-ccecd9430804\",\"content\":\"Bisnis antarpulau tetap berjalan lancar, tetapi dengan kualitas internet yang lebih lambat\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"04164dfa-8e60-48f7-b285-595785361b27\",\"content\":\"Komunikasi daring antarpulau akan tersendat jika menggunakan video dan audio yang tidak jernih\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"04ba6a29-292c-4d28-89aa-b30d278e1502\",\"content\":\"Sebelum tahun 2012, kualitas video jernih ketika digunakan untuk rapat daring antarpulau\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"6866deb2-0d06-480f-a2cc-b601792f5e8e\",\"content\":\"Sebelum tahun 2012, masyarakat baru menggunakan internet untuk pengiriman dokumen elektronik\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"8527adec-e992-4677-b1ea-33e9a7e0ed7e\",\"content\":\"Pertukaran informasi antarpulau akan menjadi lebih lancar dari sebelumnya\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('70097589-9706-4de8-8ffe-3cad8108f64e'::uuid,'7bf97abd-011e-44fd-befe-d76c0f06474f'::uuid,'"[{\"id\":\"83a8d6ab-2ce2-4114-9bc2-62cdf9e4564e\",\"content\":\"Tahun 1950-an, hanya \\\\( 60 \\\\% \\\\) penderita kanker yang ditangani, sedangkan 1980-an persentase penderita kanker yang ditangani lebih tinggi.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"377a71c8-6590-48c1-9ed4-1aa286829677\",\"content\":\"Tahun 1980-an, 35\\\\% penderita kanker tidak ditangani seperti penderita pada tahun 1950an.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"749261d0-689c-446c-aaf4-3edef2dbb2be\",\"content\":\"Tahun 1950-an tidak pernah dilakukan pendeteksian terhadap pengidap kanker secara lebih awal seperti pada tahun 1980an,\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"2b59945d-37ac-4b86-a56a-8139dddc3e92\",\"content\":\"Tahun 1980-an lebih banyak penderita kanker yang ditangani lebih baik daripada penderita kanker pada tahun 1950-an.\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"e9f4de93-2cb5-446d-a2ad-df6334c77e0b\",\"content\":\"Tahun 1980-an jumlah penderita kanker lebih banyak daripada jumlah penderita kanker tahun 1950-an.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('9ffa11f9-327d-44d5-8797-e32cd5ff5a29'::uuid,'1b17cf93-d3d2-41d9-897a-d2e14c3a2473'::uuid,'"[{\"id\":\"74b3486d-4b6b-49c8-adfd-65a4c54a2548\",\"content\":\"Buah nanas menjadi buah kebanggaan masyarakat di negara Z\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"084ff40a-3a5a-40c8-be89-8378b349d4ec\",\"content\":\"Kandungan gizi yang ada di dalam buah nanas dapat mendukung sistem imun tubuh\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"28b6c1c8-3352-469e-881c-098e90e6df54\",\"content\":\"Konsumsi buah nanas yang berlebihan dapat menyebabkan gangguan telinga\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"13b75458-6619-46dc-b38b-a19fa950e2ae\",\"content\":\"Meskipun menyebabkan gatal-gatal, konsumsi buah nanas dapat melancarkan sistem pencernaan\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"26952317-6344-4dcf-a9d5-d8a7060cf935\",\"content\":\"Konsumsi buah nanas tidak akan menyebabkan masalah kesehatan\",\"is_true\":true,\"key\":\"E\"}]"'),
	 ('d76b36fe-bab3-4466-954b-86bfd17b0a43'::uuid,'c8a1d0c7-5c30-44ee-8be8-d8ce18d99870'::uuid,'"[{\"id\":\"f561143f-4b2d-4b76-a342-2cd15173291a\",\"content\":\"Rasa gurih pada penemuan Ikeda lebih kuat daripada Maggi.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"65d84e57-52c5-466b-ba31-2aa717adaedf\",\"content\":\"Kaldu sup yang digunakan berbeda sehingga rasa gurihnya berbeda.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"4b67185c-6dc3-4198-9f06-a9076359e236\",\"content\":\"Perbedaan rasa gurih pada temuan Ikeda dan Maggi terletak pada bahan dasar yang digunakan.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"b3c5d07a-1e9b-4523-b261-d8b1196453ec\",\"content\":\"Penelitian yang dihasilkan oleh Ikeda dan Maggi berupa komponen penyusun rasa gurih.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"29cd594f-df03-4d7a-a550-b6de8e7933af\",\"content\":\"Kedua penelitian rasa gurih yang dihasilkan tidak berbeda karena penelitian berdasarkan kaldu sup.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('8ef85236-c559-45d8-80f3-e61ae1d51aab'::uuid,'9b98da68-4a97-43f0-a072-bb8e678dbdff'::uuid,'"[{\"id\":\"3971c676-7673-4eda-943e-60c3a3f6e87d\",\"content\":\"kebudayaan Jawa digunakan sebagai dasar pelaksanaan upacara Hari Raya Galungan di Kabupaten Semarang\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"1858b5cd-2c9b-4be9-8f03-ef49976b4880\",\"content\":\"ritual persembahyangan di Candi Ngempon merupakan salah satu bentuk akulturasi budaya Jawa dan Hindu\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"819211f9-1816-485b-8352-3d77771cded2\",\"content\":\"pada masa silam telah terjadi interaksi antara orang Jawa yang berkebudayaan setempat dan orang Hindu dari Bali\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"ec2ecac7-7565-47ce-aa76-78290e086ca4\",\"content\":\"akulturasi budaya, seperti halnya dalam upacara Hari Raya Galungan di Semarang, harus dipertahankan\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"5fa6cb51-ea39-443f-aeb7-ccbd685aecf6\",\"content\":\"masyarakat beragama Hindu di Semarang masih mempertahankan tradisi hasil akulturasi Hindu dan Jawa\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('4c3177f1-1770-40dd-81da-3841eec6762e'::uuid,'fd2a615a-f492-4b64-943c-584b9b68fb0f'::uuid,'"[{\"id\":\"eb059d8c-e09b-4941-a09c-cc4cafc0eac5\",\"content\":\"Anak-anak lebih memilih makan daging daripada sayuran.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"5420be47-4d25-4880-8ba7-798878a66f14\",\"content\":\"Saat ini banyak produk olahan sayuran yang digemari oleh anak-anak.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"6b460cb4-8081-47a2-8ff6-82f7446dffed\",\"content\":\"Akan lebih bermanfaat bagi orang dewasa.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"1a26914d-b98b-4218-8745-b01198fd1e57\",\"content\":\"Orang tua menggunakan berbagai cara agar anak-anak mereka mau mengonsumsi sayuran.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"211d6648-b421-49b0-a921-139f5b263f6e\",\"content\":\"Kandungan gizi di dalam sayuran akan berkurang jika dimasak terlalu lama.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('8a1b2007-cc30-418c-9859-a00acb93aa66'::uuid,'853d1ea6-8e6f-4a23-9a26-f062ba838462'::uuid,'"[{\"id\":\"41b7a6ab-a6e3-464d-9f41-5ca843934734\",\"content\":\"Para ahli banyak mengembangkan teknologi untuk berbagai bidang kehidupan\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"943c2114-3126-4514-9e5b-661955312de4\",\"content\":\"Pengembangan teknologi di bidang kehidupan dilakukan melalui penelitian\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"6f1a4939-f8b8-4f48-b194-fe4745544933\",\"content\":\"Penemuan teknologi baru menyerap dana cukup besar\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"6b9d21cb-e749-4923-9971-613416c660d0\",\"content\":\"Banyak penemuan baru di bidang teknologi yang menyebabkan perubahan sosial\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"fb8dc098-65a4-409a-a7ed-7ac79d878ea0\",\"content\":\"Temuan benda-benda bersejarah memengaruhi perilaku budaya masyarakat\",\"is_true\":false,\"key\":\"E\"}]"');
