	 ('28265108-fc61-45c8-a233-6393dc122e65'::uuid,'63398631-4d76-419b-9739-5b2d014ddd67'::uuid,'"[{\"id\":\"c8360fa8-8273-414e-922e-626b2ccfd266\",\"content\":\"ekuivalen dalam kalinat I\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"3e183cbc-6dc9-4497-b5f0-c7939c04c0d5\",\"content\":\"devisa dalam kalimat 4\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"1eab7333-82a1-45dd-9fc4-dc7b96352426\",\"content\":\"mekanisasi dalam kalimat 5\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"74de1d66-ac7f-4122-83aa-7665b6e4d08f\",\"content\":\"redenominasi dalam kalimat 9\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"0a02316b-6964-488c-8fe1-b7db185b6a6f\",\"content\":\"hiperinflasi dalam kalimat 13\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('f71d8f17-0c54-450c-83cc-737c8aa77476'::uuid,'ceb9e017-56e9-4ffa-9b81-72d513c6792b'::uuid,'"[{\"id\":\"b164a934-6575-442c-8b5c-86e37376534a\",\"content\":\"Budaya syawalan harus kita lestarikan dan kembangkan.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"3e24f351-d52b-4be5-9f50-289bf6eba884\",\"content\":\"Budaya syawalan kita harus lestarikan dan kembangkan.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"8ace1d1c-6d8a-46ee-8877-33926f1d01c1\",\"content\":\"Budaya syawalan kita harus melestarikan dan mengembangkan.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"8a1676d4-e260-4814-aa61-58978c5647af\",\"content\":\"BudayÌ§a syawalan kita harus melestarikan dan kembangkannya.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"c75d07c0-6587-4d6d-b81c-c1eddd260f20\",\"content\":\"Budaya syawalan harus kita lestarikan dan dikembangkan.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('2c4571a2-1a51-4d85-8a78-7144fc840c67'::uuid,'a0318676-84ec-41c0-9f91-bf64cfa70730'::uuid,'"[{\"id\":\"21fbad5b-357d-4229-8821-c37812cd2b57\",\"content\":\"Berhubung waktunya mepet, pidato ini diakhiri saja ya!\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"68f037c2-cf14-4b8f-8399-7ddf2cca3424\",\"content\":\"Rasanya, pidato saya tidak perlu berpanjang-panjang nanti rasanya tidak etis.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"1eb32854-364f-454e-812c-c4a6244574b1\",\"content\":\"Sekian dulu pidato saya, saya harap saudara-saudara mericerna pidato saya dengan baik.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"2d8b98a6-415f-4cfe-a0ec-0538a0858565\",\"content\":\"Sebelum pidato ini saya akhiri, mohon dimaafkan kalau ada kata-kata yang kurang berkenan.\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"71c576f0-ba1a-4e44-abcc-ef9bac1a1dd5\",\"content\":\"Rasanya, materi pidatonya sudah habis, makanya akan segera saya akhiri biar anda-anda tidak bosan\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('6200fe8d-d74e-4b99-9424-3523045061ab'::uuid,'c00a75ed-1cbc-4b1b-82f2-c89d1163c41f'::uuid,'"[{\"id\":\"199e7041-b3f1-4a84-afce-efca49d03050\",\"content\":\"yang cenderung tidak tertemukan dalam kamus, sulit pemecahannya oleh komputer, dan sulit diretas oleh hacker\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"6591721b-a24a-4502-8084-c9c5b4eb86f3\",\"content\":\"yang cenderung tidak ditemukan dalam kamus, sulit dipecahkan oleh komputer, dan hacker sulit meretasnya\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"ce4cfb20-5621-45ed-a411-471f9a4bd5dd\",\"content\":\"yang cenderung tidak ditemukan dalam kamus, pemecahannya sulit oleh komputer, dan sulit diretas oleh hacker\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"19a4bd7c-e9d9-482b-ac32-9a5a60b84db9\",\"content\":\"yang cenderung tidak tertemukan dalam kamus, sulit terpecahkan oleh komputer, dan peretasannya oleh hacker sulit\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"c67a4743-25bb-4746-8dc6-8885ab3a372f\",\"content\":\"yang cenderung tidak ditemukan dalam kamus, sulit dipecahkan oleh komputer, dan sulit diretas oleh hacker\",\"is_true\":true,\"key\":\"E\"}]"'),
	 ('617e353d-c48e-4802-a77a-043c6ebeea85'::uuid,'3b7fd51a-545c-498f-87c4-35b12e3c85a2'::uuid,'"[{\"id\":\"cbbfbe89-1824-4c7c-a8a8-990b6aac192c\",\"content\":\"Sejak dahulu Indonesia kaya dengan budaya yang beragam.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"1bec69ca-667b-4023-ab3d-13a28e5c2d6f\",\"content\":\"Kebudayaan Indonesia mengalami kemajuan yang pesat.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"1705c74c-6849-492e-92c4-5d3c7c6315e7\",\"content\":\"Kebudayaan Indonesia sekarang tidak sama dengan yang dahulu.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"ab457a1f-9d48-4a9b-89c1-d7f30680aa66\",\"content\":\"Kebudayaan nasional merupakan kumpulan dari kebudayaan daerah.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"42d17087-2643-4ce3-9d69-9329cc84215c\",\"content\":\"Kebudayaan Indonesia diperkaya oleh unsur kebudayaan global.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('6147a79b-c414-41db-ba8c-2cd60b7bf20b'::uuid,'7cd81bc0-45d7-4e07-ba48-edc303453ba6'::uuid,'"[{\"id\":\"37ce440f-5a60-4e18-97b1-f2f142b5787d\",\"content\":\"\\\\( \\\\{(1)-(2)-(3)\\\\} \\\\) dan \\\\( \\\\{(4)-(5)-(6)-(7)-(8)-(9)-(10)\\\\} \\\\)\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"c7dd330d-7f87-4924-956f-b6c7ff3cbdb5\",\"content\":\"\\\\( \\\\{(1)-(2)-(3)-(4)\\\\} \\\\) dan \\\\( \\\\{(5)-(6)-(7)-(8)-(9)-(10)\\\\} \\\\)\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"65348a05-51c2-46d3-9420-d8b877ed15b5\",\"content\":\"\\\\( \\\\{(1)-(2)-(3)-(4)-(5)\\\\} \\\\) dan \\\\( \\\\{(6)-(7)-(8)-(9)-(10)\\\\} \\\\)\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"f0a028ee-056b-4a30-bd13-c1bcb4b937c1\",\"content\":\"\\\\( \\\\{(1)-(2)-(3)-(4)-(5)-(6)\\\\} \\\\) dan \\\\( \\\\{(7)-(8)-(9)-(10)\\\\} \\\\)\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"b870c21c-87f7-409f-848e-7ea1d0d0a784\",\"content\":\"\\\\( \\\\{(1)-(2)-(3)-(4)-(5)-(6)-(7)\\\\} \\\\) dan \\\\( \\\\{(8)-(9)-(10)\\\\} \\\\)\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('93f7fd7d-e133-452a-9c81-3c7609dbbfba'::uuid,'23794edb-4590-4106-9407-19ea83b0c69f'::uuid,'"[{\"id\":\"086fe1ce-075c-476f-9140-33b6692e824f\",\"content\":\"Menguraikan maksud secara lebih spesifik\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"f10ebae9-8dfe-491b-8a12-a7fe357e8b54\",\"content\":\"menyimpulkan penyebab masalah yang telah diuraikan\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"a0ece408-fd1b-40ca-b4e4-5a614b1ab00f\",\"content\":\"menawarkan solusi praktis berdasarkan kesiapan yang dimiliki\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"54bc6265-1cb7-4267-a448-dc79fc4486e3\",\"content\":\"memerinci pandangan penulis terhadap fenomena yang diungkap\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"bb6417c8-88b9-4f59-a8e9-c2a341640d17\",\"content\":\"melanjutkan pembahasan yang fokus pada gagasan yang diprioritaskan.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('40d984c4-45a8-407e-a899-2be4778c7275'::uuid,'9413bd7c-cfd8-472f-97ba-ba833dfebe5e'::uuid,'"[{\"id\":\"c0cbeb03-2485-453c-baf0-e92510ea9a36\",\"content\":\"Memaparkan kesiapan bangsa Indonesia untuk mengatasi masalah rendahnya tingkat literasi\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"88c740de-5f32-4bd7-bd49-a91bca28a17f\",\"content\":\"Menjelaskan pentingnya upaya yang konkret dalam mengatasi masalah literasi\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"e1975d5f-406c-4290-b7bf-cd8a9ef2407b\",\"content\":\"Mengekspresikan rasa optimis penulis dalam mengatasi masalah literasi\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"c8a17257-b53f-4b9c-93f8-3f4116fcd050\",\"content\":\"Mengajak pembaca untuk terlibat dalam kegiatan pengembangan literasi\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"98738b6e-8a71-43fb-be27-cbca2bc39b84\",\"content\":\"Menguraikan beberapa langkah tepat untuk mengatasi masalah\",\"is_true\":false,\"key\":\"E\"}]"'),
