	 ('0079166a-3c6b-4a73-a4ae-10b820ad01fc'::uuid,'19c46c59-f4d3-4c56-803f-60c7773d453c'::uuid,'"[{\"id\":\"51e25171-09ff-4369-882c-39341ed29e02\",\"content\":\"Penambahan tinggi badan berdampak pada kesehatan anak yang dipengaruhi oleh variasi dan kualitas nutrisi serta kelayakan lingkungan tempat tinggal\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"27185c16-881e-4e02-a261-baf210b373a4\",\"content\":\"Variasi dan kualitas nutrisi serta kelayakan lingkungan tempat tinggal dipengaruhi oleh tinggi badan dan berdampak pada kesehatan anak\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"bc48aa35-a251-4064-9c74-ee53c57256f3\",\"content\":\"Penambahan tinggi badan yang dipengaruhi oleh variasi dan kualitas nutrisi serta kelayakan lingkungan tempat tinggal berdampak pada kesehatan anak\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"d42386be-06ac-4e87-9e19-69a5ea3b80fd\",\"content\":\"Variasi dan kualitas nutrisi serta kelayakan lingkungan tempat tinggal berdampak pada kesehatan anak yang dipengaruhi oleh tinggi badan\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"2688a0a4-0695-47c2-82e5-01e075468a97\",\"content\":\"Penambahan tinggi badan yang berdampak pada kesehatan anak dipengaruhi oleh variasi dan kualitas nutrisi serta kelayakan lingkungan tempat tinggal\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('05742862-9938-4de4-b168-177566394887'::uuid,'81f6c972-50fb-400f-9eb8-7d88e1963031'::uuid,'"[{\"id\":\"cc0ed730-15fa-499b-97f6-28ad703419fd\",\"content\":\"Pengerukan sungai secara berkala merupakan cara yang paling efektif untuk mencegah banjir saat musim hujan.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"73a39285-8141-44c0-a33c-251b956d41c9\",\"content\":\"Risiko banjir saat musim hujan berkurang jika dilakukan pengerukan secara berkala.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"abbaf61f-c968-453d-b7e1-3a0c88426b96\",\"content\":\"Pada sungai yang mengalami pendangkalan tidak dilakukan pengerukan secara berkala.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"7241cb25-d467-4833-a2ed-e778cb69963e\",\"content\":\"Pada sungai yang mengalami banjir saat musim hujan tidak dilakukan pengerukan secara berkala.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"b363410c-13c8-49f4-8702-f1d0c1f089a8\",\"content\":\"Banjir pada saat musim hujan tidak terjadi lagi pada sungai yang dilakukan pengerukan secara berkala.\",\"is_true\":false,\"key\":\"E\"}]"'),
