	 ('77d8481e-3e46-4e4b-978f-3e3c5f51cc3a'::uuid,'c28db3a1-09b7-49c5-bb79-c7c27a69386c'::uuid,'"[{\"id\":\"575cf14d-ac3f-4768-98e6-3fe1b01545de\",\"content\":\"Yang memiliki bau badan yang tidak sedap memiliki banyak bakteri di kulit ketiaknya.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"3804ae04-9378-4169-982e-64cd8a0c8bb6\",\"content\":\"Orang yang memiliki bau badan yang harum tidak memiliki bakteri di kulit ketiaknya.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"c511898c-a988-4a33-b983-9f5daadf1220\",\"content\":\"Kulit ketiak yang sering dibersihkan tidak menimbulkan bau badan.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"b87e0296-84bd-47fa-abc2-9ff0d5116f6b\",\"content\":\"Bagian tubuh selain kulit ketiak tidak mengandung bakteri penyebab bau badan.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"fe4fab9e-6b93-429f-bcc2-55b803788735\",\"content\":\"Orang yang memiliki banyak bakteri pada kulit ketiaknya cenderung mengalami bau badan tidak sedap.\",\"is_true\":true,\"key\":\"E\"}]"'),
	 ('ce51683e-38b6-4581-bd0a-0f054f2f0858'::uuid,'644630f5-3451-4195-a72a-a28d6070825f'::uuid,'"[{\"id\":\"60635cbc-8ca5-4d78-9883-d274b80ff9c8\",\"content\":\"Selain serat, vitamin dan mineral juga terdapat pada buah dan sayur.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"5926e864-8fbe-4421-ba5c-a11cb92e1c53\",\"content\":\"Perut kembung dapat disebabkan konsumsi suplemen serat secara berlebihan.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"71f11b2b-d1a4-40f8-935b-5ca8d67bbf68\",\"content\":\"Seseorang akan mengalami kekurangan vitamin jika mengonsumsi suplemen serat tanpa diimbangi buah dan sayur.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"abf0b653-94e9-433a-aea5-49b9d2526040\",\"content\":\"Perut akan terasa nyaman dengan mengonsumsi buah dan sayur.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"ab3ff235-4d88-4302-84c8-0aad087776d6\",\"content\":\"Suplemen serat dapat menggantikan buah dan sayur kandungan gizi yang lengkap.\",\"is_true\":true,\"key\":\"E\"}]"'),
	 ('3030d990-4819-418a-88ec-d6d7a9e23ab9'::uuid,'a9a1810d-ccac-4b22-9309-c2b2c342d857'::uuid,'"[{\"id\":\"56d25f62-bab5-49c4-870a-6b4d5ac02978\",\"content\":\"Hanya bidang usaha makanan dengan diversifikasi usaha makanan non unggas yang tidak terkena dampak fenomena flu burung.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"12084610-31ce-4951-8ffa-6df6f8b31f7f\",\"content\":\"Hampir semua usaha makanan tidak mengalami kerugian akibat fenomena flu burung.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"a61821e5-1e5d-4b3b-a113-90dd2ba64808\",\"content\":\"Sebagian bidang usaha makanan yang terkena dampak fenomena flu burung melakukan diversifikasi usaha makanan non unggas.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"54666770-1602-474e-898e-b731f7fef968\",\"content\":\"Bidang peternakan unggas dan kesehatan mengalami kerugian lebih besar daripada usaha makanan.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"39f51c82-17ec-4368-b428-4f19d13bef66\",\"content\":\"Bidang peternakan unggas dan kesehatan tidak mengalami kerugian karena fenomena flu burung.\",\"is_true\":false,\"key\":\"E\"}]"'),
