	 ('74963b8c-af70-401d-9d36-6855c1813e9a'::uuid,'75c6f934-dfda-4656-9639-25a988af00d4'::uuid,'"[{\"id\":\"7bdef0a6-d059-4141-b92e-f34d1d61924c\",\"content\":\"Astronaut harus memiliki mental yang kuat agar tidak mudah depresi.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"f429d885-f64b-47bd-a787-0e8caaaa356d\",\"content\":\"Penyakit jantung mengancam keselamatan jiwa usia produktif.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"670fc63e-dc80-4839-a35b-635c5c04e135\",\"content\":\"Ketimpangan produksi telah membuat situasi pasar menjadi lebih peka.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"4bf897e2-219a-4a2d-ab9d-e6f2c8c56d0a\",\"content\":\"Perekrutan pekerja di perusahaan itu sangat ketat karena beratnya tugas di perusahaan itu.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"fbfab5b8-28c1-41c4-96a5-3e3efab00a35\",\"content\":\"Pengaruh negatif media sosial telah merambah kalangan siswa sekolah dasar.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('0c5aead2-3f03-43fb-be1f-633ab0922d35'::uuid,'635c43bf-54d6-44f1-a047-6c634cd68812'::uuid,'"[{\"id\":\"c4c538d3-18b4-4795-b5a4-ed46359a1ba9\",\"content\":\"Pendidikan adalah usaha sadar yang dilakukan melalui kegiatan pembimbingan, pengajaran, dan pelatihan yang berlangsung di sekolah dan di luar sekolah.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"eae24729-35da-4104-a281-2246905063cd\",\"content\":\"Pengelolaan investasi adalah proses yang membantu perumusan kebijakan dan tujuan, sekaligus pengawasan dalam penanaman modal untuk memperoleh keuntungan\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"0b266aa4-a965-42cc-9eaf-df66319f1f6d\",\"content\":\"Wilayah persebaran fauna pertama kali diperkenalkan oleh Sclater (1858) dan kemudian dikembangkan oleh Huxley (1868) dan Wallace (1876).\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"43163d97-b784-4636-85d9-c792107731f9\",\"content\":\"Pajak tersebut dikenakan atas setiap pertambahan nilai dari barang atau jasa dalam peredarannya dari produsen ke konsumen.\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"285eae94-2c2b-4507-b219-19ec42791df0\",\"content\":\"Di aliran sungai itu, pertambangan emas dilakukan dengan menyedot pasir yang kemudian disaring dan dipisahkan emasnya menggunakan air raksa.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('8d87dea0-4dcd-4b41-aefa-5130d64daddd'::uuid,'9829f4a4-822a-4dae-9abf-8c3dcfe202a0'::uuid,'"[{\"id\":\"fa9c0262-09bb-4fae-b4f8-db000455aa21\",\"content\":\"Pembangunan Aceh ibarat ditopang fondasi pasir karena belum serius memperhatikan mitigasi bencana.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"7bb0941a-a9b9-4371-ab4f-c5c8d8321e84\",\"content\":\"Konstruksi dan disain rumah dan sekolah yang dibangun setelah tsunami lebih baik daripada sebelum tsunami.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"545cef78-3b2f-40e3-abe2-c967a044be09\",\"content\":\"Sekalipun tak sebaik kualitas jalan Banda Aceh-Calang, Jalan Calang ke Kota Meulaboh sepanjang 120 kilometer juga relatif mulus.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"c60e5054-d458-4a50-98ff-e343b6c414c1\",\"content\":\"Data statistik mendukung klaim bahwa ekonomi Aceh jauh lebih baik saat ini.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"b59203e9-e473-4dd4-8ba0-0715f83e135c\",\"content\":\"Pemerintah memprediksi terjadi peningkatan jumlah penumpang pada semua armada transportasi.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('863e9c41-3e20-44d9-b3e6-d526fcbd6efc'::uuid,'99bc76e3-14e9-4cf6-b261-71312daa8a83'::uuid,'"[{\"id\":\"caded170-443b-47a2-9928-f3278c760b6a\",\"content\":\"Untuk biaya di atas satu juta rupiah, kami harus menggunakan meterai senilai Rp6000.00.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"f47e04e9-8f65-43c1-b363-92fe3e473288\",\"content\":\"Kebijakan tersebut ditetapkan ketika Gubernur Jakarta dijabat oleh R. Soeprapto.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"d25fe5d5-be03-4509-b06c-3af187f0cf40\",\"content\":\"Seminar kesehatan anak tersebut akan dimoderatori oleh Dr. Wisanto Hadi, Sp.A.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"2b3cc000-a741-417b-bd89-8e8312457e31\",\"content\":\"Yth. Sdr. Moh. Ridwan Rais\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"35f2beb6-86ff-4af8-991d-cda88a45a7a5\",\"content\":\"Waktu baru yang berhasil dibukukan oleh pelari muda itu adalah 0.00.12.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('b39481ec-3684-413b-980a-5a58d532e532'::uuid,'f7086f95-0911-49e9-a723-21b323f99073'::uuid,'"[{\"id\":\"8f359ea7-021a-46ef-9dd5-bd2894643129\",\"content\":\"Panitia menyediakan fasilitas penginapan secara gratis bagi peserta luar kota.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"5417c5c7-04f5-49c2-b0b5-a16d3b54c6f5\",\"content\":\"Sudah menjadi kewajiban orang tua untuk memenuhi kebutuhan dasar anak.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"79442906-7581-44dc-acd8-eccc59cb2a81\",\"content\":\"Peserta kemah remaja telah memanfaatkan sarana yang tersedia di lokasi.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"78a5d9a8-b1c2-43c8-a7d0-3ed9b255506f\",\"content\":\"Moderator secara maksimal telah mengatur jalannya sidang dengan baik.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"73b71c0b-88d7-46a9-a8be-ba1ff3cb9989\",\"content\":\"Pimpinan sidang mengambil keputusan berdasarkan saran-saran anggota.\",\"is_true\":false,\"key\":\"E\"}]"'),
