	 ('650acb69-26e9-4106-ae31-55f467e81a83'::uuid,'cf4a9e77-28a2-4a61-a54c-9bc49671045c'::uuid,'"[{\"id\":\"2896fa1f-a9a3-4200-87a1-1a2b19ed3349\",\"content\":\"The use of social media advertisements can be effective when adjusted to the types of platforms and their audience.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"561c40a8-2adf-4dd3-8158-9d4c7a7ce2bb\",\"content\":\"The most important impact to consider in using social media advertisement is the interaction with users.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"3170e7f9-cac8-427d-a571-64665c033fc8\",\"content\":\"Social media platforms are now widely used by the advertising comparative to promote their products.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"26a3cbca-e98c-447a-85c8-7c4e5ce4d2dd\",\"content\":\"Using various social media platforms is a must to make the advertisements costeffective.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"00fe683e-1a43-45a1-9883-d1dbdc8cb572\",\"content\":\"Social media is the only effective way to interact with the news market.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('e3b16c95-5a8a-43a5-9785-514db136f0a7'::uuid,'374fb998-dc9d-41ab-bc42-0d919f21d56b'::uuid,'"[{\"id\":\"05b77885-1df6-4c94-b40f-2d19b70b6deb\",\"content\":\"contribute more to economic benefits for the humans'' livelihood.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"0cc59435-da40-4d8b-abda-960817feb023\",\"content\":\"address reduction of carbon emissions, biodiversity and better quality of life.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"bc6c8984-04e9-4112-8cac-edee843fab6b\",\"content\":\"result from provision of appropriate technology and economic motivations.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"11107a08-764d-40ae-9ac1-14cad555bf48\",\"content\":\"are controlled from the side economic and technological management.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"b8b2646e-dc26-49e4-af03-1f113061a45b\",\"content\":\"consider both technology and natural factors affecting livestock farming.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('a6aa1182-3c92-4350-ba64-3702aa327363'::uuid,'749b6c88-f791-4445-aca3-b8cbe770c2ed'::uuid,'"[{\"id\":\"3aee022c-3c98-4607-8103-37f327bc67d4\",\"content\":\"The increase in population, urbanization, and earnings leads to the higher demand for livestock consumption, and thus the higher carbon emissions.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"ce3b830d-eb15-4a1e-a9f2-0a6c4fe9253f\",\"content\":\"The significant increase in greenhouse gas emissions is due to changes in people''s lifestyles and activities, including the higher demand for livestock products.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"c03c6db6-2257-4d94-ae1b-5ceaf6508dcb\",\"content\":\"Desirable livestock farming is parallel with reduction of greenhouse gas emissions, improvement of biodiversity, and better socioeconomic quality of the poor.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"2c1a56f2-caad-4505-b332-d73f0ef2a588\",\"content\":\"Whatever the technological attempts are made to improve livestock production to meet the people''s demand, higher carbon emissions will constantly increase.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"50dac42f-de95-436a-9e3d-90634480a651\",\"content\":\"Although it affects positively the poor''s socioeconomic status, livestock farming activities negatively influence biodiversity as well as global climate condition.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('e977844e-d34f-405b-83bb-076537acf36f'::uuid,'c579a902-bb77-4eca-88a7-6cfe0edc5afc'::uuid,'"[{\"id\":\"a9f04f46-625a-4b57-88a3-56afedc7fd39\",\"content\":\"perhatian terhadap tubuh kita belum tentu diperlukan agar jenis diet terkesan efektif\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"c8eba162-44f6-4be0-bae5-5f9e830753f3\",\"content\":\"jenis diet yang terkesan sesuai bagi tubuh kita perlu diperhatikan agar efektif\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"c5d63355-bcf0-489b-97c6-94316353dfc6\",\"content\":\"jenis diet yang terkesan efektif namun belum tentu sesuai bagi tubuh perlu kita perhatikan\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"b3a13703-5540-424f-840c-0fd08a8b1a00\",\"content\":\"kita perlu memperhatikan tubuh kita agar jenis diet menjadi terkesan efektif\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"e2b0f581-e377-41f1-a922-1cea5846ff2a\",\"content\":\"kita perlu memperhatikan jenis diet yang sesuai bagi tubuh agar terkesan efektif\",\"is_true\":false,\"key\":\"E\"}]"'),
