	 ('a9d37a89-8522-41aa-adda-d62306c24d30'::uuid,'a6aae613-911f-4e0e-a9db-59eafa433623'::uuid,'"[{\"id\":\"6aae4a29-7c9e-4294-9cd7-b90cea6794eb\",\"content\":\"Untuk biaya di atas satu juta rupiah, kami harus menggunakan meterai senilai Rp6000.00.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"e64c82ee-0ec1-4131-9bd7-3f4909d482f3\",\"content\":\"Kebijakan tersebut ditetapkan ketika Gubernur Jakarta dijabat oleh R. Soeprapto.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"8b45b732-9d9c-439a-b3d4-a10a3aa8b38a\",\"content\":\"Seminar kesehatan anak tersebut akan dimoderatori oleh Dr. Wisanto Hadi. Sp.A.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"cfbea548-013a-4280-bcca-cccdf07f5e89\",\"content\":\"Yth. Sdr. Moh. Ridwan Rais\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"1aff58f9-4f7b-4b26-87c0-1e9170ffba5e\",\"content\":\"Waktu baru yang berhasil dibukukan oleh pelari muda itu adalah 0.00 .12 .\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('76276716-641c-4427-9316-325d8be557d7'::uuid,'838cde24-40bd-4590-a338-9204dd3ef096'::uuid,'"[{\"id\":\"c411280b-4ef0-4a64-a971-52e80d3f48d3\",\"content\":\"24\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"7d02affd-9b17-4497-b64f-d5d13ca2961e\",\"content\":\"27\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"94b2b5c3-7549-4651-b589-4dca76bbaf93\",\"content\":\"22\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"07b0e9f7-5a34-4048-9897-fed00397cbdc\",\"content\":\"-24\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"3ee088b2-171e-44ac-8b46-b5d9337deade\",\"content\":\"-27\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('e3b4bd8c-20db-46a5-8647-cfa9c31cb7db'::uuid,'e9463ec4-ec73-444c-92ca-ba5514bae0fc'::uuid,'"[{\"id\":\"4f2c8583-1d37-41b9-b588-18e415e39b29\",\"content\":\"Dengan demikian, ada keinginan untuk mempelajari, mempraktikkan, ataupun mendirikan suatu institusi sebagai wadah belajar.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"5081ee7c-7bbf-4b49-a89c-57e2664ab085\",\"content\":\"Padahal, menurut Baneson, salah satu penyebabnya adalah kurangnya perhatian pemerintah terhadap budaya asli daerah, terutama di daerah perbatasan.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"1e8bf521-dcb5-4eef-a8e9-fc6be1d15835\",\"content\":\"Keberadaan rumah panjang atau betang sebagai tempat siswa berlatih tari, juga diperlukan sebagai simbol kembalinya karakter masyarakat Dayak.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"1074cf46-300d-4d5c-8f44-d1a424b44601\",\"content\":\"Dalam pengelolaan sumber daya alam, misalnya, provinsi ketiga terluas di Indonesia ini dihadapkan pada dua kepentingan pengelolaan, yakni antara pemerintah pusat dan daerah.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"dacba352-2818-4ee1-9441-60f988078794\",\"content\":\"Oleh karena itu, menurutnya, perlu dilakukan persiapan sehingga apabila pengajuan disetujui pada tahun 2017, hal itu bukan merupakan awal gerak, melainkan sebagai bonus terhadap program yang secara nasional telah dilakukan.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('30e9f229-dfcf-4fdb-b1b7-57be0dc35641'::uuid,'1cdd6c1f-3887-475f-9ae0-875c755273b9'::uuid,'"[{\"id\":\"a3699241-853d-4055-81f3-b661ea901e37\",\"content\":\"halal bihalal, manca negara, pascasarjana\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"d69b8ec1-ab45-4069-925f-2fbcbe19de05\",\"content\":\"assalamualaikum, kerjasama, bea siswa\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"09ec9980-c1ab-41e6-b012-3848d65e919d\",\"content\":\"sapu tangan, tandatangan, bagaimana\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"2e887233-ea42-45dc-a637-85b4fa5f0daf\",\"content\":\"acapkali, adakalanya, olah raga\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"12506ce1-51fd-42da-b258-ecf68d0543ac\",\"content\":\"mata kuliah, meja tulis, orang tua\",\"is_true\":true,\"key\":\"E\"}]"'),
	 ('af1cc10c-f008-4865-8c5c-801f09d50335'::uuid,'c14e49ef-a5c0-4a62-8d96-489be2b83624'::uuid,'"[{\"id\":\"93ba9bb5-67d0-486c-8576-eff111ec5fe0\",\"content\":\"\\\"Apakah kalian dengar suara ''tok,tok,tok'' seperti orang mengetuk pintu?\\\" tanya Ria kepadaku.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"f382bbdd-3749-40f3-9ed7-036c6551fdb3\",\"content\":\"Di masa itu, ada istilah ''indehoy'', yaitu berpacaran di tempat-tempat yang jauh dari perhatian orang, misalnya di taman yang rimbun atau di gedung bioskop yang gelap.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"d1ea6a36-fb8c-4ea0-9c2f-a635ae20a6cd\",\"content\":\"''Dia telah banyak berubah sekarang,'' kataku dalam hati ketika bertemu Kartika dalam reuni itu.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"c7945d00-4bf3-4cd0-ad78-2a771ab198bc\",\"content\":\"Karena ciri fisiknya yang menonjol, Lesmana diberi julukan ''si jangkung'' oleh temantemannya.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"919a6920-2e5a-4575-b5cd-a9e93575bb23\",\"content\":\"Dalam tahap tersebut, pasien akan mengalami gejala ''angin'' atau \\\"nyeri dada\\\".\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('80dcc87c-4ef6-410c-9fa9-44b5267cdcf1'::uuid,'73c67e19-827c-4bd1-951b-db24a0bbddec'::uuid,'"[{\"id\":\"9a74ac30-d106-4a77-8308-5fa86e8e2f00\",\"content\":\"Suntikan obligasi dapat mendatangkan pendapatan yang pasti; penghilangan kredit menjadikan neraca perbankan bersih.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"c36ccc2e-c81f-40a3-be06-e10a02a8bc36\",\"content\":\"Kehadiran obligasi rekap memberikan tiga keajaiban; pendapatan yang pasti, kolektibilitas yang lancar, dan pencadangan yang kecil.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"684564af-2123-47a9-833c-332a67282246\",\"content\":\"Pertama, bank memasyarakatkan produk dan layanan jasa kepada masyarakat; menyalurkan kredit ke sektor perdagangan, jasa, transportasi, dan industri.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"f710d08a-db0a-4b19-95b5-48d70213f373\",\"content\":\"Bank itu dinyatakan pailit awal tahun ini; padahal kinerjanya dianggap baik tahun lalu.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"c8fbeca6-fa1c-490c-a703-2ecaeec30a9e\",\"content\":\"Karena modal di bank terbatas; tidak semua pengusaha lemah memperoleh kredit.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('b2dd6073-603e-4e36-bbcc-3d3305d9ebc1'::uuid,'11fdaa6d-32cc-49e9-9ac9-9f7a123f3645'::uuid,'"[{\"id\":\"e5103cdd-a3a8-4db0-90b5-bfccf39b15bf\",\"content\":\"Pembangunan Aceh ibarat ditopang fondasi pasir karena belum serius memperhatikan mitigasi bencana.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"eb17e3c7-040b-48fc-aa23-4bd30fdc86f3\",\"content\":\"Konstruksi dan disain rumah dan sekolah yang dibangun setelah tsunami lebih baik daripada sebelum tsunami.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"05afd629-4eb0-4334-b2e4-bb9ef38a41bc\",\"content\":\"Sekalipun tak sebaik kualitas jalan Banda Aceh-Calang, Jalan Calang ke Kota Meulaboh sepanjang 120 kilometer juga relatif mulus.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"cf5f288b-3bbd-410c-857b-598671b564bc\",\"content\":\"Data statistik mendukung klaim bahwa ekonomi Aceh jauh lebih baik saat ini.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"522f53fd-7c1c-4609-af68-0ac871a1088a\",\"content\":\"Pemerintah memprediksi terjadi peningkatan jumlah penumpang pada semua armada transportasi.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('6727fc81-9da1-4c50-a051-86b944d8dac6'::uuid,'fe8dc381-234a-4934-874b-0c777fdf5df7'::uuid,'"[{\"id\":\"7df0e96f-0849-4a44-b7e2-cc634d6ecaa1\",\"content\":\"Apakah kamu punya uang kertas sejurnlah 10 paun Inggris?\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"dce7fb85-911c-4c25-a2c8-f61082dc7465\",\"content\":\"Jumlah siswa yang masuk hari ini adalah 37 orang.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"e5a40eac-9926-4389-95f6-9cb780b04c78\",\"content\":\"Empat ratus orang petugas kebersihan akan bertugas pada pekan raya ini.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"be4f8092-b196-4dbc-8fec-a8ade132cfbb\",\"content\":\"\\\\( 10 \\\\% \\\\) penduduk di kota tersebut tidak mendapatkan akses terhadap air bersih.\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"0541b3c7-e9ca-4421-95f7-827ecfcdeabe\",\"content\":\"Tiap pengungsi mendapatkan bantuan 10 liter beras.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('0634a3e3-f767-46b3-89a1-3c94efc3d754'::uuid,'4a25c6bd-66b4-415f-8972-7e25461b7221'::uuid,'"[{\"id\":\"cf9a323b-7a36-4f26-931e-2403c8c67272\",\"content\":\"Sisi interkonektifitas videocard ini masih standar.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"85a17b26-1e5c-4a33-95fb-15f74d55f998\",\"content\":\"Produk ini merupakan modifikasi, terutama pada penggunaan HFS nonstandar.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"4c07d457-aa98-4652-8863-5649ef86771f\",\"content\":\"Produsen Saphire menghadirkan seri videocard Toxid yang ekstrim.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"218c990c-b69c-4044-9a2c-b8b9e7f09222\",\"content\":\"Disain papan juga berbeda dari yang biasanya.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"c27f55d1-333e-4b01-b40d-41bd131928cb\",\"content\":\"PCMAV 4.0 secara automatis akan mendeteksi virus yang mengganggu komputer Anda.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('62353eec-7dac-4505-8e63-c3fe3408269d'::uuid,'cf8316bf-342e-4c5c-a37a-65e8bbea7131'::uuid,'"[{\"id\":\"a442ee4b-88ff-4093-91d0-6bf0c39f8823\",\"content\":\"Kekalahan itu diantaranya disebabkan oleh ketidaktahuan peran anggota.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"64036c78-d2ff-4844-a1d9-1ad23a9b1408\",\"content\":\"Sejak tahun lalu banyak penggemar yang mengikutinya ke mana pun dia pergi.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"4dac684e-265f-485c-98ae-46420d72480d\",\"content\":\"Walku sudah dipancing berkali-kali, tidak sekali pun dia mengajukan pertanyaan.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"35492504-0fad-4ac3-b285-ba81d694a5ea\",\"content\":\"Untuk memasuki ruang studio, satu per satu pengunjung diperiksa petugas.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"5eb6a1a0-8d1a-4ebc-b708-ac464ec2c6fc\",\"content\":\"Pada tahun lalu dia mampu menyumbangkan lima medali emas bagi daerahnya.\",\"is_true\":false,\"key\":\"E\"}]"');
INSERT INTO public."options" (id,question_id,"options") VALUES
	 ('79f4b112-7862-46fd-92d0-587408c5a2a1'::uuid,'21de8b66-49a1-4586-b43f-c39fa6f36858'::uuid,'"[{\"id\":\"b2b53f89-8f6e-4c3d-9e17-6e4f6b7b3fc6\",\"content\":\"model linear; orang tua; olahraga.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"671652b1-b3a0-416e-800e-712117895da9\",\"content\":\"persegi panjang; bumi putera; olah raga.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"2e54a327-de11-45eb-ac3a-2703759d1d33\",\"content\":\"puspa warna; radioaktif; saptapesona.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"2ef840a6-e823-492b-8919-3c1da31de4b0\",\"content\":\"simpang empat; rumah sakit; darma siswa.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"c2d8a82f-bb46-4c7b-b0a0-6e7ef7c02d8b\",\"content\":\"acap kali; bea siswa; kaca mata.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('c0c08c7f-e146-4e6f-85e9-23f03eb49d34'::uuid,'855b4301-74a1-411d-95be-d913fb4d4f8d'::uuid,'"[{\"id\":\"eaa11d4e-abeb-41b4-950b-b9536edeabc3\",\"content\":\"memberikan tanda koma (,) setelah kata itu\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"c0efebcc-ed3d-4e36-82f0-99f40fe885cc\",\"content\":\"tanda petik (\\\") di depan dan di belakang 1001 malam dihilangkan\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"cb15d02b-013c-4fda-89f2-c4e0bf451e34\",\"content\":\"mengubah huruf \\\\( K \\\\) pada Kela menjadi \\\\( k \\\\)\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"3c22d897-02e3-464e-ace4-b721867c24da\",\"content\":\"mengubah kata hovig menjadi bercetak tegak\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"eb47b5a2-3b0b-481e-b6c6-4233b9bbcc14\",\"content\":\"mengubah huruf \\\\( h \\\\) pada hovig dan \\\\( b \\\\) pada bangka menjadi \\\\( H \\\\) dan \\\\( B \\\\)\",\"is_true\":true,\"key\":\"E\"}]"'),
	 ('494f20f4-01b6-4064-b87d-451c76268348'::uuid,'79bcfc5d-ec0e-4d3c-aa5d-5c43e832f4fe'::uuid,'"[{\"id\":\"f787d571-be2a-48b1-a06c-768efd899f8b\",\"content\":\"bahasa Inggris\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"16112297-a2b9-4ea8-9d2b-dc3c7ec1b5b6\",\"content\":\"bangsa Inggris\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"c6456e7f-d962-4d3b-854d-8582085812c9\",\"content\":\"kunci Inggris\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"9eca9483-ade7-4e75-94ba-3bc795b8382c\",\"content\":\"Perdana Menteri Inggris\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"7412e12d-789f-4286-8655-c6157b24d46b\",\"content\":\"rakyat Inggris\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('01cd093d-6716-4c80-a60e-263bd1ff00e4'::uuid,'3bc55dfe-f959-489b-8f89-abc1fcad830a'::uuid,'"[{\"id\":\"2ffd2fcd-c0ae-4824-9285-24de2b7f041b\",\"content\":\"Bila berkunjung ke Makassar, Ibu Kota Provinsi Sulawesi Selatan, jangan lupa mampir di toko cenderamata.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"ec9d9b2b-b387-42cd-ba04-12e1efcd6bfb\",\"content\":\"Sepanjang perjalanan, kapal yang kami tumpangi ke Kepulauan Krakatau terus diguncang gelombang.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"f77ce970-e5c8-4062-a5fd-ac36b6ae800c\",\"content\":\"Kebebasan dapat Anda rasakan saat bersepeda di jalan Lingkar Luar Jakarta.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"263ed4aa-90ca-4d28-af53-a23125f49cb3\",\"content\":\"Perjalanan kami lanjutkan ke Desa Pandes Sempokan.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"862d7f31-e88e-45e5-b69e-95c1e7a543e4\",\"content\":\"Di antara dominasi warna terakota keramik dan gerabah yang memenuhi sisi jalan, kami menemukan Toko Hasta Kreasi yang menjual patung keramik.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('531319a7-8a5b-404a-9bb0-2ae979c904d0'::uuid,'fd786dd9-d062-4170-a70b-94a66a559233'::uuid,'"[{\"id\":\"ff6005a2-8ca7-4fdc-a509-47098d5d8fd4\",\"content\":\"Ia akan mempertanggungjawabkan perbuatannya.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"64ac24b8-d3b9-4313-848c-f283a190e521\",\"content\":\"Sudah saya beritahukan masalah itu kepadanya.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"829ce29c-07d9-46fc-b5c1-82eb21f4c992\",\"content\":\"Kami tidak bertanggungjawab atas peristiwa itu.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"214c9cf0-0c2d-44af-b432-cf5f5bada683\",\"content\":\"Tolong beritahu mereka!\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"388bf5c1-88e1-4740-aadf-9cc607cb3db3\",\"content\":\"Pemberi-tahuan itu datang terlambat.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('8aadd64c-a703-45f2-8af5-03164a121cac'::uuid,'77c2c535-cf30-48b5-9d9e-4599923defc0'::uuid,'"[{\"id\":\"c93b0617-3b29-480f-a9c1-f271ab53b5aa\",\"content\":\"Tak ubahnya Jakarta, jalanan Kota Boston pun ruwet, karena tak mudah dijelajahi dengan mobil.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"60da9128-5b03-4868-94b6-fa054e429d49\",\"content\":\"Pada tahun 2006, untuk ketiga kalinya, majalah Bicycling memasukkan kota ini ke dalam daftar kota terburuk di AS bagi pesepeda.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"6dea037d-0529-43da-a83a-2ba21d9c1128\",\"content\":\"Menino akhirnya memahami manfat dari budaya ramah sepeda-demi lingkungan-yaitu, mengurangi kepadatan lalu lintas dan menyehatkan masyarakat.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"af1601f0-cc0f-4ebe-9aba-a1606691390e\",\"content\":\"Kota-kota, mulai dari Louisville hingga Los Angeles, menawarkan kemudahan akses bersepeda, dan wisatawan adalah sasaran utama fasilitas tersebut.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"9004c48d-8c9a-45bf-b258-e7f2add2044d\",\"content\":\"Sejumlah larangan membatasi keberadaan sepeda di jalanan umum, sehingga memudahkan akses ke pedalaman, atau menggenjot naik menyusuri pesisir sepanjang Old Highway.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('0118a64f-00c9-4615-bb35-547e0482fe33'::uuid,'ff44ec5d-3876-4a98-b832-4e6e97ddc326'::uuid,'"[{\"id\":\"a023b5f4-0758-481b-9cad-04fda3e15bc0\",\"content\":\"azasi; akte; jjazah.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"631cb8cf-7c2c-44a0-acca-da2defbc8f4c\",\"content\":\"zaman; khawatir; khusyu.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"be04c303-2d97-45b8-8ad0-3d4e0a4cf159\",\"content\":\"lembap; antre; khaul.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"6aeaaeb3-837d-4e33-816f-99207227e932\",\"content\":\"khazanah; khawatir; khuldi.\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"9763785a-1689-4347-adc1-1efd965529ea\",\"content\":\"trampil; paedagogis; energi.\",\"is_true\":false,\"key\":\"E\"}]"'),
