	 ('d85e9e8e-9820-43e2-be4b-ec24d46b3e0c'::uuid,'12da107e-a6b5-4c7c-a22e-f0f662193bad'::uuid,'"[{\"id\":\"0daf7ad9-74c3-462e-aaae-1afb9c7bdabe\",\"content\":\"Simpulan tersebut pasti benar.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"526def66-5cbb-4a4a-bc54-08ee7fa82f06\",\"content\":\"Simpulan tersebut mungkin benar.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"e886d279-fc28-4523-a41e-3d9faa226418\",\"content\":\"Simpulan tersebut pasti salah.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"b1ca8183-82a3-425f-8742-bfec7e791f4a\",\"content\":\"Simpulan tidak relevan dengan informasi yang diberikan.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"e34b8876-5429-4245-a453-e3f4df7186d2\",\"content\":\"Simpulan tidak dapat dinilai karena informasi tidak cukup.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('eb7f7fa8-ffe5-407a-9d14-d88515b569b7'::uuid,'236d3bbc-c836-4ea0-9be6-cce232a1b1ba'::uuid,'"[{\"id\":\"75a779a2-48c8-4d68-9490-3e4f4af1eb1b\",\"content\":\"Menurut Sugiyarto (2008: 11) orang gemuk dan anak-anak usia sekolah jauh lebih rentan terserang sakit hingga meninggal akibat virus flu babi Hl N1 (dalam Mashudi, 2010).\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"be299ae9-934c-44df-a184-1aca979d6c41\",\"content\":\"Sugiyarto (2008) dalam (Mashudi, 2010) menyatakan bahwa orang gemuk dan anak-anak usia sekolah jauh lebih rentan terserang sakit hingga meninggal akibat virus flu babi H1 N1.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"063f49df-b0bb-4265-954b-a34ec2405f9e\",\"content\":\"Sugiyarto (dalam Mashudi, 2010) menyatakan bahwa orang gemuk dan anak-anak usia sekolah jauh lebih rentar. terserang sa kit hingga meninggal akibat virus flu babi HINI.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"aa9dbbfb-befe-4e96-8e50-125a9e602006\",\"content\":\"Orang gemuk dan anak-anak usia sekolah jauh lebih rentan terserang sakit hingga meninggal akibat virus flu babi H1 N1 (Sugiyarto, 2008 dalam Mashudi, 2010).\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"c0a8ae3d-bd2b-4cc0-a696-35e8bc08db88\",\"content\":\"Menurut Sugiyarto (2008:11 dalam Mashudi, 2010:37), menyatakan bahwa \\\"orang gemuk dan anak-anak usia sekolah jauh lebih rentan terserang sakit hingga meninggal akibat virus flu babi H-I N1\\\".\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('acf2744d-819c-484e-b6a7-1cdce49e25c5'::uuid,'3c519032-cc79-4544-93c9-b70587a3dd34'::uuid,'"[{\"id\":\"f30db1e0-01c8-42a2-b2bd-4b03fa6c7962\",\"content\":\"para pedagang berhutang di Bank Rakyat yang berasal dari Kampung Melayu.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"2655f32e-2955-4c46-9a72-796d53edfe3f\",\"content\":\"para pedagang di Kampung Melayu tidak memiliki jaminan di Bank Rakyat.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"713f68cd-6ba7-44ee-bdeb-bde7e9207c63\",\"content\":\"para pedagang di Kampung Melayu memiliki jaminan di Bank Rakyat.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"1255b456-e35b-4398-bc0c-17d6cd5df051\",\"content\":\"para pedagang yang memiliki jaminan berhutang di Bank Rakyat.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"0d721858-9150-4ecb-8f94-69f10a92df35\",\"content\":\"para pedagang di Kampung Melayu berhutang di bukan Bank Rakyat .\",\"is_true\":false,\"key\":\"E\"}]"');
INSERT INTO public."options" (id,question_id,"options") VALUES
	 ('da594ddc-145f-421b-ac2c-223b9bdad5ce'::uuid,'bbf9dcdb-f0a2-4ef9-b1d0-b8e67f078b1f'::uuid,'"[{\"id\":\"3e0cee59-3c7c-448c-8128-f771078f1555\",\"content\":\"Pencapaian pasangan yang baru terpilih sebagai wali kota dan wakil wali kota itu belum sepenuhnya sesuai ekspektasi warga. **Meskipun**, semangat keduanya untuk melibatkan partisipasi masyarakat tampak jelas dalam uji public tentang rencana pembangunan ruas tol.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"23fb0c0d-7195-440b-9fd8-ad1a88016e8b\",\"content\":\"Pemimpin wilayah itu mempunyai mandat menjalankan kepemimpinan selama lima tahun. **Namun**, dalam praktik politik pemerintahan, peringatan 100 hari pemerintahan kerap dijadikan titik evaluasi.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"eef7d319-6381-4771-9403-bb06072848fb\",\"content\":\"Melibatkan partisifasi karyawan secara langsung jelas menunjukkan ke mana pimpinan perusahaan berpihak. **Tetapi**, kompromi dengan pemangku kepentingan perusahaan perlu juga dilakukan agar inovasi dapat lancer dijalankan.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"0179524f-b0d6-4422-96d8-360d0da85800\",\"content\":\"Dalam menjalankan tugas, dekan menangani hal-hal yang berurusan dengan pihak lua, seperti membuka kerja sama dengan berbagai institusi. **Sedangkan** wakil dekan berkonsentrasi pada penanganan masalah di dalam fakultas.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"ff320cbf-d99f-49f2-8684-b723d3b7d256\",\"content\":\"Sumber kecemasan belum hilang karena zona Euro dan Jepang masih dilanda resesi ekonomi. **Sementara** AS masih sulit keluar dari kelesuan ekonomi.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('8f1fdc8b-a162-486c-9ecf-21167b1c6cd0'::uuid,'13a96bba-bea3-43df-b211-255f66fc8f85'::uuid,'"[{\"id\":\"bfed42cf-9646-4d27-8b5b-7897830951dc\",\"content\":\"People are encouraged to do Chinese healing exercises because they provide many benefits for people''s life and cost very low. Moreover, these exercises do not require special equipments, sports gear and apparel.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"7b28ac60-f837-4a98-81e2-5aea862e0d22\",\"content\":\"While some types of Chinese healing exercises have been considered useful, some others still need further research-based justification. These exercises tend to be more detailed and complex, thus they demand much higher skills from people who want to practice them.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"ec0377d8-a8d6-4337-8c33-f7300963ebc4\",\"content\":\"Desfite many benefits provided by Chinese healing exercises, they are not so popular among people seeking for alternative medical treatments. This is because they are not aware of the advantages those exere ses have.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"f2cf0e9e-79e2-49ce-a652-90ea43dc2b49\",\"content\":\"Chinsse healing exercises can be a good option for those who want to improve their quality of life. These exerc ses include acupressure, tuina, taiji, qigong, and other medical, spiritual and self-defense practices, whict: may promote overall functionality of person''s well-being.\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"be7ab3d1-e323-4002-a0a9-b3c9cc3619f4\",\"content\":\"These exerc ses include acupressure, tuina, taiji, qigong, and other medical, spiritual and self-defense practices, whict: may promote overall functionality of person''s well-being.\",\"is_true\":false,\"key\":\"E\"}]"'),
