	 ('e88a18b0-db28-4a4c-a08f-4816a2c93053'::uuid,'eaf1cca6-3a0d-4138-ad9e-9dd7b044ee4b'::uuid,'"[{\"id\":\"44638663-a854-422c-b0f1-d86e996220d3\",\"content\":\"Teknik-teknik dasar badminton hanya diperoleh di pusat pelatihan bulu tangkis \\\\( X \\\\)\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"b5029916-c1c6-4aec-888a-38eae1fba576\",\"content\":\"Pemain badminton profesional banyak berasal dari pusat pelatihan bulu tangkis \\\\( \\\\mathrm{X} \\\\)\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"e427736e-9a60-4f05-b59a-34b8b9f2b790\",\"content\":\"Pemain badminton di atas 12 tahun tidak ambisius untuk memenangkan pertandingan\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"2946f742-1356-473d-85cd-b4e2a1dc5027\",\"content\":\"Para pemain badminton di pusat pelatihan bulu tangkis \\\\( X \\\\) berlomba-lomba untuk menang\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"09f41714-e83f-4af7-a7cf-4a065e755eaf\",\"content\":\"Pemain ambisius termotivasi untuk mengikuti pertandingan di luar negeri\",\"is_true\":false,\"key\":\"E\"}]"'),
