	 ('d3728bc4-0c40-4310-9c2a-e828466f431b'::uuid,'4ae369e6-630a-45b3-b305-c99f2f948e45'::uuid,'"[{\"id\":\"2dbf0bca-99de-4e96-98d7-fc6a688d8849\",\"content\":\"Sebelum Puskesmas A berdiri, sudah banyak warga yang ingin memeriksakan kesehatan\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"0624d294-3bb3-4207-9112-f3da5aa1bda4\",\"content\":\"Pemerintah membangun banyak Puskesmas di wilayah \\\\( \\\\mathrm{X} \\\\) untuk mengatasi penyebaran penyakit infeksi\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"c0a873ef-0aef-4771-be14-89d546587238\",\"content\":\"Setelah Puskesmas A berdiri, banyak tenaga kesehatan yang datang ke wilayah \\\\( X \\\\)\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"290111f3-042c-4c32-9097-bfe8c9c3004d\",\"content\":\"Pada saat Puskesmas A belum berdiri, kondisi ekonomi masyarakat di wilayah \\\\( \\\\mathrm{X} \\\\) tergolong rendah\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"f5bbb6d3-486f-422e-bad1-57b57643e30c\",\"content\":\"Puskesmas A membuat program pencegahan penyakit infeksi di wilayah \\\\( \\\\mathrm{X} \\\\)\",\"is_true\":true,\"key\":\"E\"}]"');
