	 ('f5aa3dcd-ae47-4841-996b-8a39a708deb6'::uuid,'e359c4bb-5bf0-46c6-87ed-556b75a2d7a2'::uuid,'"[{\"id\":\"b0234c97-5ce0-421f-9529-3ceade84508b\",\"content\":\"Kemacetan di jalan terjadi karena tarif transportasi online yang murah\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"eb63e087-4372-4008-ad01-039c1952d401\",\"content\":\"Semua orang yang menggunakan transportasi online tiba di tujuan tepat waktu\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"20391d64-08b4-44ea-ae36-f438a67a996d\",\"content\":\"Moda transportasi lain memberikan tarif yang lebih mahal dibandingkan kendaraan transportasi online\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"db6be718-a117-416e-821d-626eb364ca97\",\"content\":\"Waktu perjalanan moda transportasi lain tidak dapat diprediksi\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"5e845eb9-dd8b-422c-815b-b003fbee62cc\",\"content\":\"Beberapa permasalahan lalu lintas terjadi karena meningkatnya jumlah kendaraan transportasi online\",\"is_true\":true,\"key\":\"E\"}]"'),
	 ('5dae6e92-6a90-440a-8c37-5ed4a6b19538'::uuid,'8475977d-62cc-4fd6-ba0c-bf5badb9506c'::uuid,'"[{\"id\":\"2b5e6d4e-b5bc-41c2-b283-e340725f6290\",\"content\":\"Mendengarkan musik klasik secara konsisten dapat meningkatkan keterampilan belajar siswa.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"88e3bea7-70fc-44a6-b5b7-30951426c783\",\"content\":\"Musik klasik dapat membantu seseorang dalam mengingat materi pelajaran.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"47bf2e2d-928b-4146-b395-1d2dab9940f4\",\"content\":\"Anak dari orang tua pemusik mempunyai daya ingat yang baik.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"9050d0d1-2405-4fc7-83b8-cf0ac40b532a\",\"content\":\"Anak yang berprestasi di sekolah sering mendengarkan musik klasik.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"76289aed-c049-4ccd-af1a-03169f7cda6a\",\"content\":\"Seseorang dengan kemampuan mengingat yang tinggi selalu berada dalam suasana hati yang baik.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('1762ed37-18ee-4ec4-bb45-5a2469ae0480'::uuid,'6d6f2546-764f-4891-b88b-04eef375fbb9'::uuid,'"[{\"id\":\"a8bdc717-59d6-485c-86b9-29688de2aeff\",\"content\":\"Sebagian madu lebah hutan mengandung bakteri yang berbahaya untuk janin.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"b5fc4361-de8d-4261-9f05-6d6968c022d2\",\"content\":\"Beberapa orang tua menyarankan putrinya yang hamil untuk mengonsumsi madu.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"256141dd-8cba-4815-965e-0fb60f0d5154\",\"content\":\"Ibu hamil yang mengonsumsi asam folat lebih banyak daripada ibu hamil yang minum madu.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"cff95e6e-722d-49b2-aeb6-d24642c5c583\",\"content\":\"Sebagian ibu hamil merasa lebih bertenaga setelah mengonsumsi madu.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"a59f8351-365a-424b-a0c7-0a0bc40a27c8\",\"content\":\"Ibu hamil dianjurkan berkonsultasi ke dokter apabila ingin mengonsumsi madu.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('fce18555-e30e-47ed-b1c8-ad03889e176a'::uuid,'b4cb10d2-8e93-4ece-ad46-d54f0971f6e1'::uuid,'"[{\"id\":\"ca51b104-8f81-461b-b6b3-90f8d18c49fe\",\"content\":\"Mengonsumsi sayuran, susu atau telur merupakan cara yang paling efektif untuk meningkatkan kadar serotonin.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"4e004cfa-ea27-4b55-bdf9-ccaa5771da6a\",\"content\":\"Seseorang yang mengalami peningkatan kadar serotonin dalam darah tidak mengonsumsi sayuran, susu atau telur.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"0d6f2bcb-d3b2-4c8d-9f0c-1a24cf9020e5\",\"content\":\"Penderita sakit kepala yang mengonsumsi sayuran, susu atau telur mengalami penurunan kadar serotonin dalam darah.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"78d52e68-bf3d-4be5-9412-da3ec01d8d77\",\"content\":\"Orang yang mengalami sakit kepala tidak mengonsumsi sayuran, susu atau telur.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"60c55ba2-671c-4e40-9378-73541b8ea412\",\"content\":\"Sakit kepala akan sembuh melalui peningkatan asupan vitamin B.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('8ea0a98d-cb90-44e6-848c-e4b1c99e1332'::uuid,'a8e4e919-938a-49ec-bb40-d803fff6e192'::uuid,'"[{\"id\":\"827a0517-60b4-4701-bad8-6a36086d5141\",\"content\":\"Sektor pariwisata yang makin maju menyebabkan kunjungan wisatawan mancanegara makin meningkat.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"b3e34c9d-682b-4c65-b558-9d857644f922\",\"content\":\"Program promosi yang dilakukan pengusaha kuliner membantu meningkatkan pemasukan negara.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"c9c0d55d-2a91-4b71-9d73-2c9e6c119bed\",\"content\":\"Tidak tersedianya anggaran negara untuk sektor pariwisata menyebabkan pengusaha kuliner melakukan promosi.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"73c92b2c-51e9-40d5-b36a-cb5493c2e452\",\"content\":\"Meningkatnya pemasukan negara dari sektor pariwisata menyebabkan kunjungan wisatawan mancanegara meningkat.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"073c5b77-d39b-43b4-8f72-7cf861736cf5\",\"content\":\"Kondisi ekonomi yang sulit menyebabkan pengusaha kuliner melakukan program promosi.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('24dea1ec-4a2a-426e-80e3-b5cb855ce4df'::uuid,'084b3ca3-2049-4e3e-a29b-74fcdfd05abf'::uuid,'"[{\"id\":\"9b4050f4-d25a-41ad-9084-34fcb3cecaf4\",\"content\":\"Pernyataan (2) adalah penyebab dan pernyataan (1) adalah akibat.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"fe22a7c1-6657-40c7-96a5-62dab2b53ce5\",\"content\":\"Pernyataan (1) dan (2) adalah akibat dari suatu penyebab yang sama.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"71bf39ea-c05b-42a1-befe-b2d9035d2beb\",\"content\":\"Pernyataan (1) dan (2) adalah akibat dari dua penyebab yang tidak saling berhubungan.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"919c199a-21c1-4684-9d63-d905a70a043d\",\"content\":\"Pernyataan (1) dan (2) adalah penyebab, namun tidak saling berhubungan.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"231c4f56-06c2-4b08-bd9e-c8dc598fe220\",\"content\":\"Pernyataan (1) adalah penyebab dan pernyataan (2) adalah akibat.\",\"is_true\":true,\"key\":\"E\"}]"'),
	 ('4ae87f82-191a-4b3a-b7c4-c33adf8f3656'::uuid,'fdbc953b-2d8d-4100-83a7-055167e9e04c'::uuid,'"[{\"id\":\"802c283b-e6f9-4645-9084-97c164531798\",\"content\":\"Memperkuat pernyataan ahli A\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"86ff7b5d-d67d-437e-9f69-b308fa075b47\",\"content\":\"Memperkuat pernyataan ahli B\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"8c213821-6d29-4919-9c75-5520d01c9e6b\",\"content\":\"Memperlemah pernyataan ahli A\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"cc5488e1-d0b2-4726-8f08-39ccb4c08c54\",\"content\":\"Memperlemah pernyataan ahli B\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"614c0d94-4fe2-4086-b5dc-bdb2a0eb99fb\",\"content\":\"Tidak relevan dengan pernyataan ahli \\\\( \\\\mathrm{A} \\\\) dan ahli B\",\"is_true\":true,\"key\":\"E\"}]"'),
	 ('7c26559e-2be2-4c03-83be-77299ca38ca6'::uuid,'75c06e1a-714d-4892-9360-c78a803a277f'::uuid,'"[{\"id\":\"739aecb4-1665-401f-9ba8-09f5ea015b11\",\"content\":\"Raisa mengetahui bahwa J. S. Bach dilahirkan di kota Eisenach.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"e7310aaf-4f42-49b4-9b32-495108376fdc\",\"content\":\"Isyana tidak mengetahui bahwa J. S. Bach dilahirkan di kota Eisenach.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"0ca3078f-f2b7-4973-94a3-8913c7e4c7b0\",\"content\":\"Raisa mengetahui bahwa J. S. Bach dilahirkan di kota Leipzig.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"23f9dd35-7041-4495-9491-eef369b3801b\",\"content\":\"Isyana mengetahui bahwa J. S. Bach tidak dilahirkan di kota Leipzig.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"10af4ab5-be43-4d8d-bd7d-0e189863cb35\",\"content\":\"Raisa tidak mengetahui bahwa J. S. Bach dilahirkan di kota Eisenach.\",\"is_true\":true,\"key\":\"E\"}]"'),
	 ('640c4abc-99aa-40c8-85a1-b7dfd8e2c3aa'::uuid,'700dc406-84d6-4871-84f2-26c7e73ff26c'::uuid,'"[{\"id\":\"268ae566-04a3-45dd-9b81-f174c4e6bbc6\",\"content\":\"Kemajuan teknologi memudahkan pekerjaan manusia.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"0ff993ec-0ace-464c-89aa-f8d1ed48a408\",\"content\":\"Kemajuan teknologi digunakan untuk melakukan tindak kejahatan.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"0bd38fea-825a-410d-aef5-f1f4953dc197\",\"content\":\"Kemajuan teknologi memudahkan manusia dalam berkomunikasi.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"aa627f4f-423a-4e3b-a065-9cf7ec6adf57\",\"content\":\"Kemajuan teknologi membuat manusia malas melakukan pekerjaan berat.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"b33914b3-17b8-49ce-bec7-be6bf7f7dcc4\",\"content\":\"Kemajuan teknologi dapat memberikan dampak baik maupun dampak buruk.\",\"is_true\":true,\"key\":\"E\"}]"'),
	 ('325a9f2f-acfc-4353-b095-7969acaddbe3'::uuid,'fe3406c2-5941-455e-965a-ac509b061aba'::uuid,'"[{\"id\":\"a84caa5d-75ee-4123-ad0b-16873c608932\",\"content\":\"Negara tersebut negara maju yang memberikan fasilitas teknologi kepada warganya.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"405bd320-2367-40a5-8a5d-70f28d75d1e1\",\"content\":\"Negara tersebut adalah negara maju yang memiliki penelitian terbaik di bidang teknologi.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"9dd39921-185c-4608-982f-d9c0c1a67d1a\",\"content\":\"Negara tersebut adalah negara maju yang memiliki teknologi canggih yang terbaru.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"63516d1c-a0d4-4252-b01b-95af75ac8128\",\"content\":\"Negara tersebut adalah negara maju yang memasukkan nilai budaya dalam berkomunikasi.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"8e5fc81f-6b9a-4a08-b4a9-7651d42be26a\",\"content\":\"Negara tersebut adalah negara maju yang menerapkan teknologi komunikasi dan informasi.\",\"is_true\":true,\"key\":\"E\"}]"');
