	 ('519770ec-f665-4f5c-9c37-0cd6f70aeaae'::uuid,'7ac8ab93-882d-4dbd-ac71-3b7d22b28ff8'::uuid,'"[{\"id\":\"d3380803-8f9c-4532-9e4d-c1be604f923b\",\"content\":\"Suatu peristiwa tidak dapat diketahui orang di seluruh dunia pada saat yang sama apabila teknologi komunikasi tidak mengalami kemajuan.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"f0e86a55-ea78-4bdd-8ce8-4b589e79bb75\",\"content\":\"Suatu peristiwa dapat diketahui orang di seluruh dunia pada saat yang sama apabila teknologi komunikasi mengalami kemajuan.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"94f4d78d-10ff-48e2-8a7f-590f3196b526\",\"content\":\"Suatu peristiwa tidak dapat diketahui orang di seluruh dunia apabila orang tidak mudah berkomunikasi.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"b827e49a-907f-48af-ae51-4ab5f087c6e1\",\"content\":\"Orang tidak mudah berkomunikasi apabila peristiwa tidak dapat diketahui orang di seluruh dunia pada saat yang sama.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"1b7c7710-d057-4e95-b481-b8c0b0d23860\",\"content\":\"Orang mudah berkomunikasi apabila peristiwa dapat diketahui orang di seluruh dunia pada saat yang sama.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('040ccea5-5008-4d1f-b704-c51c3b40c4ee'::uuid,'f93184be-5d06-4c21-aab0-764cf2010f13'::uuid,'"[{\"id\":\"b92dabca-6a02-4eea-a531-0821dc99595f\",\"content\":\"Bahan nilon lebih tahan lama dan lebih mahal daripada katun.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"2fa3170b-5b62-44d8-9bda-93c67a2628ca\",\"content\":\"Bahan nilon tidak lebih tahan lama, tetapi lebih mahal daripada bahan katun.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"e072f347-2484-45ec-bd93-8fda240d9cdc\",\"content\":\"Bahan nilon tidak lebih tahan lama dan tidak lebih mahal daripada bahan katun.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"0320b7bb-b7bb-45e0-8cf9-24e5e2f39516\",\"content\":\"Bahan nilon lebih tahan lama, tetapi tidak lebih mahal daripada bahan katun.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"9affa2e7-db59-46b5-9e10-0eb78bdad64e\",\"content\":\"Bahan nilon sama tahan lama dan sama mahalnya dengan bahan katun.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('215ee95b-fd9d-438f-910a-cc8541af3394'::uuid,'b2c21eaf-5bb6-4dab-a80d-546b995e5935'::uuid,'"[{\"id\":\"cb53b8ae-7676-438c-97a6-dd7ebf6d4e36\",\"content\":\"Badu tidak membayar untuk naik kereta api.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"54cc2512-b3bb-4959-b793-4a5b15e3508e\",\"content\":\"Badu membayar kontan untuk naik kereta api.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"c434ddf0-b63a-4b15-87a3-3bcecb92deb9\",\"content\":\"Badu membayar dengan tiket abonemen.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"f3e31d0a-2215-4aed-bd51-f029ea65bbc2\",\"content\":\"Badu tidak mempunyai tiket abonemen.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"13877339-8af0-4136-a382-75285ed087dc\",\"content\":\"Badu tidak mempunyai uang kontan.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('dced887c-9cd4-404d-a281-ce7207999788'::uuid,'513593d9-0615-4d50-814e-4b1e7ccb9088'::uuid,'"[{\"id\":\"b836957e-b237-44e2-bfe9-f89c4e8af115\",\"content\":\"semua penyelam adalah pelaut.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"a28e3e7c-bd1f-43c9-8a01-03418d8c2492\",\"content\":\"semua penyelam bukan pelaut.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"ef4c19fc-20cb-458d-bc59-2f30abd6c32d\",\"content\":\"sebagian penyelam bukan perenang.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"c0c42374-2c40-4f72-8191-b27725204984\",\"content\":\"semua pelaut adalah penyelam.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"651bad1f-7bb7-43b6-83a6-0b10ae218efa\",\"content\":\"sebagian pelaut bukan penyelam.\",\"is_true\":true,\"key\":\"E\"}]"'),
