INSERT INTO public."options" (id,question_id,"options") VALUES
	 ('91098bd2-1df7-440e-90da-396ba9b74763'::uuid,'918d7671-d774-4c9e-a7ac-efd172bbfb7e'::uuid,'"[{\"id\":\"fcefff89-0714-4d21-9d64-bffb64e94178\",\"content\":\"Fungsi hutan tidak dialihkan menjadi lahan pertanian jika harga kayu jati mahal.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"1777d8c3-a368-4835-baa0-f14028533898\",\"content\":\"Fungsi hutan dialihkan menjadi lahan pertanian jika harga kayu jati tidak mahal.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"f54ffab6-6fa9-4a09-b97e-d33b1a4cb347\",\"content\":\"Harga kayu jati semakin mahal jika fungsi hutan dialihkan menjadi lahan pertanian.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"cfbc2f45-0395-42d7-99a7-abd0c107fc2f\",\"content\":\"Harga kayu jati semakin mahal jika fungsi hutan tidak dialihkan menjadi lahan pertanian.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"58548973-c6bf-4993-8889-da5bc3cbd8b2\",\"content\":\"Harga kayu jati tidak semakin mahal jika fungsi hutan dialihkan menjadi lahan pertanian.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('4c8c1d6c-3493-4852-84fc-6e0a2f458515'::uuid,'765b5fa9-9151-4a6f-98c9-c6ee9b0cc949'::uuid,'"[{\"id\":\"47ce43fe-a54e-47a1-bff4-bf8b8f4f29d0\",\"content\":\"Semakin tinggi penghasilan wanita, semakin tinggi kemungkinannya untuk tinggal di kota besar.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"94ee5e08-f7c9-4400-bc3f-8c5e87736ef8\",\"content\":\"Jika pengetahuan wanita mengenai dampak pernikahan usia dini semakin tinggi, wanita lebih memilih berkarier dibandingkan menikah.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"6e46332c-f5b7-4147-b6cb-eb813c548d00\",\"content\":\"Jika pengetahuan wanita mengenai dampak pernikahan usia dini semakin tinggi, keputusannya untuk menikah di usia dini dapat dicegah.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"839ed93b-dfef-41eb-9bc9-d3069b79c7dd\",\"content\":\"Semakin tinggi penghasilan wanita, semakin tinggi pengetahuannya mengenai dampak pernikahan dini.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"9a6866eb-1c5a-4fa1-b48c-c00f5f92471e\",\"content\":\"Semakin tinggi kemungkinan seorang wanila tinggal di kota, semakin tinggi pengetahuannya mengenai dampak pernikahan dini.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('0beda76d-97dc-4117-bff1-b11047742e8d'::uuid,'472f2f02-4718-4860-93a3-69d76c660f3f'::uuid,'"[{\"id\":\"f7c8f3f1-3bd0-4a42-8051-7ff9695b1ebe\",\"content\":\"Pada tengah malam tidak diselenggarakan program khusus bagi pembeli di toko tersebut.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"e82c4759-7be7-46f1-9213-251a54b62e5d\",\"content\":\"Pada tengah malam, pembeli tidak dapat mengikuti program khusus di toko tersebut.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"4b212987-4f0d-4964-a0d1-185c5fd9c2e6\",\"content\":\"Pada tengah malam tidak diadakan pembagian bonus kupon belanja bagi pembeli.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"73cf193b-514b-4905-8c31-4e9587a3aa58\",\"content\":\"Pada tengah malam, toko tersebut membatalkan program khusus bagi pembeli.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"a5ba76ff-d129-4b77-b988-1c981c71029d\",\"content\":\"Pada tengah malam diselenggarakan program khusus bagi pembeli, yaitu potongan harga.\",\"is_true\":true,\"key\":\"E\"}]"'),
