	 ('f4b436e7-42da-4eef-bd35-38b48a6957e3'::uuid,'33cb3f0d-bf80-4d21-941c-e69b525b0fa6'::uuid,'"[{\"id\":\"8198a1a4-1c2b-4b19-b176-8203f3ae83f6\",\"content\":\"Pernyataan (1) SAJA cukup untuk menjawab pertanyaan, tetapi pernyataan (2) SAJA tidak cukup.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"013cd9f4-7f41-488d-96de-1949b591cacc\",\"content\":\"Pernyataan (2) SAJA cukup untuk menjawab pertanyaan, tetapi pernyataan (1) SAJA tidak cukup.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"7cafddb9-98b3-4384-b645-66943eb95bf5\",\"content\":\"DUA pernyataan BERSAMA-SAMA cukup untuk menjawab pertanyaan, tetapi SATU pernyataan SAJA tidak cukup.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"0e2b19c3-ae60-458d-ad72-d403854ab14d\",\"content\":\"Baik Pernyataan (1) SAJA, maupun (2) SAJA cukup untuk menjawab pertanyaan.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"81abe297-d817-482c-b383-189dba07cdf6\",\"content\":\"Pernyataan (1) dan pernyataan (2) tidak cukup untuk menjawab pertanyaan.\",\"is_true\":false,\"key\":\"E\"}]"'),
