	 ('b79890c2-5e8e-4229-aa1c-ebd108e85018'::uuid,'a0455161-ab25-431c-8516-2841d89abd52'::uuid,'"[{\"id\":\"cd9bac5a-5009-4e87-944d-d5da176e8389\",\"content\":\"Semua remaja desa berambut panjang dan memiliki mata indah.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"98aeea73-2656-4c4c-9e9c-e226727010b9\",\"content\":\"Semua remaja desa berambut panjang memiliki mata tidak indah.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"2f03aa88-9e01-4fbd-a002-e2b1b775cdcd\",\"content\":\"Sebagian remaja desa berambut tidak panjang dan memiliki mata indah.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"b98cd122-9365-488a-bd3a-d061a1c43e3a\",\"content\":\"Sebagian remaja desa berambut panjang dan memiliki mata tidak indah.\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"43ce870c-8ee5-4c25-8d9b-a2df22982d1f\",\"content\":\"Semua remaja desa berambut tidak panjang dan memiliki mata tidak indah.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('66ace43d-b8b3-4a04-b268-2cd096698002'::uuid,'36e24ef8-842c-4a17-b70b-0878e0598cea'::uuid,'"[{\"id\":\"ed84ef6e-e7a4-48c0-8ceb-0dd513d65d7b\",\"content\":\"semua guru dan dosen menggunakan buku tentang intemet.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"54f7bcd2-36f8-4915-b0f5-02aea1975212\",\"content\":\"semua guru dan dosen menggunakan bukan buku dan bukan internet.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"15740480-6822-4adb-9507-633ef682d761\",\"content\":\"sebagian guru dan dosen menggunakan buku dan internet.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"24d1bb87-e2b8-4c94-843b-d4dd09dabacb\",\"content\":\"sebagian guru dan dosen menggunakan buku tentang internet.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"31ffaf92-f4d0-4a65-99c7-e10b41acdb23\",\"content\":\"semua guru dan dosen menggunakan buku dan internet.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('4a9d08cf-992f-4e8b-b7f8-e7f4aab63eef'::uuid,'d8a06771-dda7-46c6-a91a-c6a766cf8713'::uuid,'"[{\"id\":\"8a979e69-a5ed-4147-9ebf-3bf995dbdee3\",\"content\":\"Oleh karena itu, ketiga lembaga penegak hokum tersebut jangan saling tuding menghadapi Dewan Rakyat dan Pemerintah.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"3f4d5d18-8201-4943-873a-b330fe1c7868\",\"content\":\"Dengan demikian, sebaiknya ketiga lembaga penegak hukum itu bersama-sama berjuang menentang pembahasan KUHP dan KUHAP.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"1d9b46a3-d3a6-49ec-936b-c77fdbb2ea5e\",\"content\":\"Jadi, ketiga lembaga itu merasa senasib dalam masalah pembahasan KUHP dan KUHAP oleh Dewan Rakyat dan Pemerintah.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"9feb16df-cea6-4a87-9bc9-e4c85bffc991\",\"content\":\"Meskipun demikian, kedudukan ketiga lembaga penegak hukum itu tidak sama dalam KUHP dan KUHAP.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"54e9b975-aa8c-4a05-9318-43b8b0bb6c6a\",\"content\":\"Untuk selanjutnya, ketiga lembaga tersebut harus selalu berpendapat sama dalam menghadapi pembahasan KUHP dan KUHAP di Dewan Rakyat\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('8f62e91d-2962-46b1-9fc3-f812793d6740'::uuid,'48755f32-6fa6-45dd-bfcc-4797703b5a51'::uuid,'"[{\"id\":\"a4ea0fac-2fc7-45d7-8121-3e4236dd8a6a\",\"content\":\"Saat matahari terbit, cuaca tetap berkabut.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"8d17384e-bf74-4f59-854b-0d20a509fb78\",\"content\":\"Hujan turun sesudah matahari terbit.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"b535b637-1ee5-452b-bbe3-dd2552784478\",\"content\":\"Kabut pada pagi hari itu sangat tebal.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"2cf6733e-a2f9-4a94-ad68-7b4d7feacff3\",\"content\":\"Sinar matahari tidak mampu menembus kabut itu.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"6153f1a7-61d9-4326-9949-280b0aab4408\",\"content\":\"Saat itu, cuaca mendung.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('80548f10-38f9-435b-b29d-f5a2352781e5'::uuid,'53230d4d-0242-4ae5-ab91-4a19b198a5f4'::uuid,'"[{\"id\":\"f2e34371-e179-40ea-b9e4-604d567bacc6\",\"content\":\"Aku adalah seseorang yang bekerja di kantor polisi.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"e3545a32-8c5c-4355-a5a5-167c6da84170\",\"content\":\"Aku sedang duduk menunggu matahari terbit.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"8061bb6e-c8f7-4d41-9cb7-ca0cee941359\",\"content\":\"Aku datang ke kantor polisi untuk memberikan keterangan.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"b59a6ed4-f479-484c-9c01-11a7309e573f\",\"content\":\"Aku datang ke kantor polisi untuk menemui seorang agen polisi.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"323c58ba-453b-459a-b502-8881a81232c5\",\"content\":\"Aku tiba di kantor polisi pada pagi hari.\",\"is_true\":true,\"key\":\"E\"}]"');
