	 ('555fe54c-d109-48ae-b10a-3bb8cdba3163'::uuid,'cb30b73d-a5bc-462a-90db-676c90dbeb16'::uuid,'"[{\"id\":\"fe1b7a56-8f95-4f6e-b284-fdbcef927852\",\"content\":\"Kerajaan Banten adalah salah satu kerajaan Islam di Indonesia.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"665f70c7-661e-4b3e-a3c2-8154d5cb1503\",\"content\":\"Keraton Surosowan merupakan bukti bahwa Kerajaan Banten pernah Berjaya.\",\"is_true\":true,\"key\":\"B\"},{\"id\":\"f28c38cd-63ba-48de-ab76-47fd320a0296\",\"content\":\"Para peneliti pernah melakukan penggalian di Situs Keraton Surosowan.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"7c8e7b1e-c84b-4642-9bf5-7d9a5ac918d1\",\"content\":\"Keraton Surosowan dibangun pada masa Sultan Hasanuddin.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"2387d2ac-b250-4260-a541-2ebd4723bd64\",\"content\":\"Keraton Surosowan saat ini hanya berupa puing-puing.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('687ab7ac-3b53-4cc9-94f4-53ed8fd410a1'::uuid,'78d3b306-8fc9-43e1-a0ae-fa49e26f26dc'::uuid,'"[{\"id\":\"a12a0b4c-c841-4a5c-b418-3713b67e3541\",\"content\":\"Keraton Surosowan mengalami pasang surut.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"5336f256-34b2-4755-82eb-becfe8c12485\",\"content\":\"Keraton itu kemudian hancur dan dibangun kembali oleh Sultan Haji tahun 1680 sampai dengan 1681.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"8c9dce4c-4385-4c7a-a95f-527830e34d2f\",\"content\":\"Keraton ini mengalami kehancuran kembali oleh Belanda.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"e1650ad5-2d84-411c-81f5-648e2b4bc4e4\",\"content\":\"Keraton Surosowan hanya berupa puing-puing.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"8bb75dfc-bc32-4696-8c9d-6f93c4b627cd\",\"content\":\"Keraton itu dibangun kembali oleh Sultan Haji tahun 1680 sampai dengan 1681.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('0ddb4c00-75d1-4f83-9078-d1063d4b9aef'::uuid,'5d0e50e6-5508-4b7e-9d97-54aa2eda8f70'::uuid,'"[{\"id\":\"db9a153f-b1d1-4730-beaa-b9122bb0fcfb\",\"content\":\"Keadaan tertentu pada tubuh memengaruhi keadaan bagian lain pada tubuh kita.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"9dc6dfe8-3c88-4198-ac3d-42c8cd3d6153\",\"content\":\"Penyakit dalam tubuh membuat orang menjadi stres.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"c52147d3-28a3-47df-95b0-3fabb0e650ad\",\"content\":\"Pandangan kedokteran gigi sejajar dengan pandangan kedokteran jiwa.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"1725c282-2a1e-4213-a427-831454f3889d\",\"content\":\"Ungkapan \\\"mind-body connection\\\" bermakna sama dengan \\\"mouth-body connection\\\".\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"53405fed-2f8c-47a2-a9be-f9f6776db5e4\",\"content\":\"Penyakit di dalam tubuh berkaitan dengan keadaan pikiran.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('a1650503-8a18-4e57-a06d-8d13ccbd935e'::uuid,'3b498eed-392a-4146-b6d3-2abfc9d197c5'::uuid,'"[{\"id\":\"3c66060a-8dbd-4290-9dad-3ac740b45de7\",\"content\":\"Mobil akan berkarat jika dicat dengan cat konvensional.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"723b327a-dcb1-4041-aabb-e18528a13165\",\"content\":\"Debu dan kotoran dapat menempel pada cat sehingga warna cat menjadi pudar.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"6fa3028e-665b-42c3-9a49-12e5b5cf9452\",\"content\":\"Cat konvensional meninggalkan permukaan tidak tertutup cat secara sempurna.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"7d658c0f-5551-4d89-b74e-9824cfb9315e\",\"content\":\"Mobil yang tidak dicat dengan sempurna dapat menerima udara, kotoran, dan debu dengan leluasa.\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"9e83edc0-90ec-4ae0-8eae-d41fd5fe37c5\",\"content\":\"Proses perkaratan logam terjadi karena proses pengecatan yang tidak sempurna.\",\"is_true\":false,\"key\":\"E\"}]"');
