	 ('177d3350-ab2d-4924-a4b7-727d5d9749b8'::uuid,'f98081ef-ddd2-4ed6-9b70-19b2789ff1b6'::uuid,'"[{\"id\":\"0e73b439-1a2e-41ee-a4cd-808056dc07bc\",\"content\":\"Sepak bola merupakan habitus baru masyarakat dunia sekarang untuk mengurangi solidaritas, sportivitas, religiositas manusia yang semakin lemah.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"b8ddfeee-3b55-4869-89b8-53efb7b0b0d8\",\"content\":\"Sepak bola dapat menjadi sarana untuk membangun solidaritas, sportivitas, persaudaraan, dan perdamaian serta tidak sekadar merupakan sarana komersial.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"e7c738d7-75b6-414d-bebf-07eab919e2b9\",\"content\":\"Habitus baru sepak bola diperlukan dalam dunia yang serba komersial dan penuh kekerasan sehingga sepak bola harus tanpa batas.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"eecec36e-e3a7-4421-9f8e-aea58efe97c9\",\"content\":\"Slogan sepak bola tanpa batas mengisyaratkan cita-cita baru umat manusia untuk menjaga perdamaian dan membangun persaudaraan dan menjauhi kekerasan.\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"382f2020-3cc2-4a01-b6c2-77495cb8f53d\",\"content\":\"Kekerasan yang kerap membayangi persepakbolaan Indonesia menuntut kita memahami slogan sepak bola tanpa batas sehingga terciptanya kedamaian dan persaudaraan.\",\"is_true\":false,\"key\":\"E\"}]"'),
