	 ('a7cb870b-32a5-4ba7-bbe0-30d901929fad'::uuid,'d33a59f1-1cd4-4495-8c38-0d6d8d692366'::uuid,'"[{\"id\":\"2ad3fd02-952c-49fc-9a00-457f6f098861\",\"content\":\"Gas air mata dapat menyebabkan luka fatal pada kepala\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"c0bfbc59-8d1e-41a1-b126-7d58b00e2e84\",\"content\":\"Tabung yang digunakan pada gas air mata dapat menyebabkan cacat permanen\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"a1c973a3-4e96-4659-bc0b-14c40402b089\",\"content\":\"Telah menyebabkan kematian pada lebih dari dua orang\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"3c414f6c-3405-47f0-921f-9b9088dca1fb\",\"content\":\"Tercatat dapat menyebabkan cacat permanen akibat terpapar gas air mata bahkan kematian\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"8ff2b674-60f6-43be-a381-5895e53e2352\",\"content\":\"Dari 5.910 orang dalam penelitian, lebih dari setengah mengalami cacat permanen\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('2f642c3d-4f80-4d6a-bfc1-a097117e4660'::uuid,'9ec493a4-9c35-48bc-8052-2a38de43e5dc'::uuid,'"[{\"id\":\"2fa9113b-85c8-48ec-90e4-2d3bc121a344\",\"content\":\"Orang tua jangan sering memberikan permen kepada anaknya.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"f4e52e87-901c-4061-b568-e05b2a1b22e9\",\"content\":\"Hasil riset tentang permen mengagetkan orang tua.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"88f11a88-9383-43fc-907f-7544f7cfc561\",\"content\":\"Permen mempunyai dampak buruk bagi penikmatnya.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"9dfab026-ee81-4fa7-ab1a-570096f47740\",\"content\":\"Anak yang suka makan permen setelah besar melakukan tindakan kekerasan.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"7ec4435b-d303-49cd-9934-f543926b9d44\",\"content\":\"Kandungan vitamin pada permen sangat sedikit.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('f3eead1e-fa63-4d6c-bd99-d54ba9b2258f'::uuid,'878e1182-0c36-44c7-8a6d-bfb05c70f052'::uuid,'"[{\"id\":\"3d1438a3-7586-49a4-9fd2-e67bf0710be0\",\"content\":\"Salju yang ada di tempat itu akan menyusut.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"01da28b5-f831-438e-9e38-c839455308d1\",\"content\":\"Terjadi pemanasan global.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"13f8b122-43cd-4217-a82b-d430ec8e33bb\",\"content\":\"Terjadi pelelehan lapisan glacier seiring dengan pemanasan global.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"19823fdb-95a4-4f0b-86b3-02343811e45b\",\"content\":\"Hal ini disebabkan oleh terjadinya penyusutan glacier sebanyak \\\\( 33 \\\\% \\\\).\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"be05afac-f284-46f4-aac4-fc37cb9c35c1\",\"content\":\"Terjadi fenomena alam berupa pemanasan global selama 27 tahun di area itu.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('808f5d5f-cff1-436b-8830-f8f5ce450bcb'::uuid,'66ed9486-00d2-4acf-b29f-b01da58352f9'::uuid,'"[{\"id\":\"fb85d7c6-5cd8-4660-a8ed-bae4ce62781f\",\"content\":\"Untuk membunuh se-sel kanker di dalam tubuh Anda, konsumsilah kunyit.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"09c7c3fb-7b91-4cb1-80b1-1128dbc2df1f\",\"content\":\"Jika ingin merasakan kehebatan kunyit, cobalah olahan kunyit setiap saat.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"17a4d945-36dd-4e3a-9530-cfc5908fec2f\",\"content\":\"Supaya kunyit mampu membunuh sel-sel kanker, campurlah dengan lada hitam.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"e38e54d1-16ea-46d7-ad6c-234fe4c3a050\",\"content\":\"Agar khasiat kunyit lebih baik, gunakanlah kunyit hasil olahan sendiri.\",\"is_true\":true,\"key\":\"D\"},{\"id\":\"a3d34e7f-ead1-4427-ab42-0e5084e8ac41\",\"content\":\"Apabila Anda ingin kepraktisan, nikmatilah kunyit buatan sendiri.\",\"is_true\":false,\"key\":\"E\"}]"');
