	 ('d1560b63-2440-4c87-af2e-d0fc99c92de9'::uuid,'5516b1c3-e230-47a4-95e9-e1e32b1c4843'::uuid,'"[{\"id\":\"b648399f-a603-4ea0-b27a-446111a59849\",\"content\":\"Masyarakat mengharapkan pembangunan kesehatan.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"0177fa0d-5fec-4062-94b7-4abf0fab33db\",\"content\":\"Presiden merancang sistem kesehatan masyarakat.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"5c8d4070-ce4e-434b-b829-84910785d1df\",\"content\":\"Janji calon presiden tidak sebanding dengan visi reformasi.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"33bef5ec-fee4-4a45-970a-ed149e073d0f\",\"content\":\"Biaya pengobatan akan terjangkau oleh rakyat.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"d1344064-c135-4e94-a956-23b88b4da02a\",\"content\":\"Visi reformasi bidang kesehatan sesuai dengan janji calon presiden.\",\"is_true\":false,\"key\":\"E\"}]"'),
