	 ('828fd3b0-6b4a-4677-8b08-e2d5875a0dd0'::uuid,'e74665f5-6c25-49d7-9cf6-8d355e6e1451'::uuid,'"[{\"id\":\"c8ccf59d-2194-47fb-81d4-2e301a8ddf8c\",\"content\":\"Oleh karena itu, beli dan milikilah kamus agar mudah menemukan arti kata.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"a453a88b-473c-4c37-912e-bfa8cbf77342\",\"content\":\"Dengan demikian, keberadaan kamus di perpustakaan sekolah sangat penting.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"4bf42c2b-d203-434f-920e-a5f119fa1426\",\"content\":\"Jadi, Anda perlu mengoleksi berbagai kamus agar mudah mencari arti kata.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"773f28fa-e7f5-4dbd-ab79-6294575623f4\",\"content\":\"Dengan demikian, milikilah kamus dan biasakan membaca kamus dengan cermat.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"e51d7e64-6c3c-4780-93a9-200d94f07838\",\"content\":\"Oleh sebab itu, biasakanlah membaca kamus secara tepat dan cepat.\",\"is_true\":true,\"key\":\"E\"}]"'),
