	 ('8bbc47ce-4bab-4200-a8bd-04c97f412cb5'::uuid,'b0e0ba1b-54d6-4c31-9ba3-2a6098922215'::uuid,'"[{\"id\":\"c671648f-5a38-4f20-aed2-626824b94d6f\",\"content\":\"Kesadaran masyarakat untuk mencegah pencemaran sungai akan membantu kelestarian sungai.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"7ff7006d-063a-439f-bd7e-c9ca8640c6b7\",\"content\":\"Kesadaran menjadi modal dasar bagi peningkatan perilaku yang baik dalam memperlakukan sungai.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"f2188697-244d-43bd-883d-26ad33edd821\",\"content\":\"Perilaku tidak membuang sampah dan tidak membangun rumah di bantaran sungai membantu kelestarian sungai.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"e03bec7f-3cfd-45b4-8764-ef7f5f3b0ddb\",\"content\":\"Kesadaran menciptakan sungai yang lestari mencerminkan keserasian lingkungan hidup manusia.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"618876fb-5fee-499a-a48a-1a37487bfa43\",\"content\":\"Dampak kelestarian sungai adalah air bersih tetap tersedia dan kesehatan masyarakat tetap terjaga.\",\"is_true\":false,\"key\":\"E\"}]"'),
