	 ('d26ae66f-1e17-4af3-ad18-458b2188845e'::uuid,'42cd7716-5fa3-44ef-ac96-5535dbab9d5a'::uuid,'"[{\"id\":\"5c7bfa2b-49e0-43db-89a2-e723f5e3f583\",\"content\":\"Menurut Charles Musyoki, Direktur Jenderal Dinas Satwa Liar Kenya, jerapah di Kenya telah anjlok 40 persen dalam waktu 30 tahun terakhir.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"01f9ed7c-3224-4810-8d80-0ca1067e99c2\",\"content\":\"Kenya melakukan usaha untuk mencegah perburuan liar dan memastikan bahwa proyek-proyek infrastruktur tidak akan merusak habitat jerapah.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"ac92bc92-d348-477b-817d-2c2fd2daa7e6\",\"content\":\"Kenya menghentikan perburuan liar dan penyakit yang bisa memusnahkan satwa terlangka yang ada di Kenya.\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"0bc94470-2ef7-4327-81be-f53b9f01f442\",\"content\":\"Hanya Kenya dan Uganda yang memiliki jerapah jenis Rothschild.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"0d99bee6-a2e3-4ede-a594-ae0a1835a423\",\"content\":\"Kenya akan melakukan berbagai hal untuk mencegah turunnya populasi jerapah itu.\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('0226bb9f-2d2a-4573-896b-6cc875bb5e0d'::uuid,'4acc5f6f-d021-49c5-8cc7-bdc042506f65'::uuid,'"[{\"id\":\"d1eeabbf-459c-40c9-b6b7-5119730263e0\",\"content\":\"Pernyataan pemerintah Kenya tentang punahnya jerapah.\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"947f3e2d-8581-4d8e-9249-a58cd0e7abad\",\"content\":\"Jerapah jenis Rothschild hanya tersisa di dua negara di Afrika.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"99fe1424-bd15-4f55-bd35-670ae9ddb3cf\",\"content\":\"Pencegahan pemerintah Kenya terhadap tindakan perburuan liar.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"e567fb7c-0c3b-4c15-bfed-b40109978c37\",\"content\":\"Upaya yang dilakukan Kenya untuk mencegah hilangnya habitat tempat jerapah hidup.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"e0bde364-71d9-4d0e-876f-2a1982e86f00\",\"content\":\"Upaya yang dilakukan Kenya untuk mengatasi terancam punahnya jerapah.\",\"is_true\":true,\"key\":\"E\"}]"'),
