	 ('2edd477c-9337-4228-af02-f555214f3d21'::uuid,'50005774-f862-47ab-8f6a-61df1cfbb9a2'::uuid,'"[{\"id\":\"0faf4cb7-aabf-45a2-9edd-7b63f53c261c\",\"content\":\"Anak yang diarahkan pada keterampilan musik memperoleh kepercayaan diri, kemampuan berbahasa yang baik, dan keterampilan motorik halus\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"f1f3c191-d5f2-45f6-9954-240c714e5271\",\"content\":\"Keterampilan yang diperoleh anak dari musik diarahkan untuk meningkatkan kepercayaan diri, kemampuan berbahasa yang lebih baik, dan keterampilan motorik halus\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"30e0ff16-edfd-46a8-90dd-79078db72491\",\"content\":\"Musik diarahkan pada pemerolehan keterampilan untuk kepercayaan diri yang lebih besar, kemampuan berbahasa yang lebih baik, dan keterampilan motorik halus\",\"is_true\":true,\"key\":\"C\"},{\"id\":\"9ea8a3f8-3499-464e-86c1-e9f16a2d214e\",\"content\":\"Anak memperoleh keterampilan yang diarahkan kepada kepercayaan diri yang lebih besar, kemampuan berbahasa yang lebih baik, dan keterampilan motorik halus\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"7d5d05da-a843-4a8d-993f-dd72d2458db2\",\"content\":\"Keterampilan musik diperoleh anak untuk diarahkan peningkatan kepercayaan diri, kemampuan berbahasa yang lebih baik, dan keterampilan motorik halus\",\"is_true\":false,\"key\":\"E\"}]"'),
	 ('aa8277c4-c9d5-4d86-b9a5-d492ef92f2a3'::uuid,'10703131-2e6c-4d5f-acb1-9b7aeaaf665b'::uuid,'"[{\"id\":\"1c1b911d-3149-4ab1-950e-04f7dd1bbb67\",\"content\":\"Terapi musik dapat meningkatkan fungsi mental dan penyembuhan, di samping meningkatkan rasa sejahtera\",\"is_true\":false,\"key\":\"A\"},{\"id\":\"432bcc85-94b2-42e9-b441-bb9aa5c0325a\",\"content\":\"Fungsi, mental, penyembuhan, dan rasa sejahtera dapat meningkat melalui terapi musik\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"299c0cde-6075-4556-91d0-805026b830d8\",\"content\":\"Selain untuk mempercepat penyembuhan, terapi musik juga dapat meningkatkan fungsi mental dan meningkatkan rasa sejahtera\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"c07aa581-f6ca-4d07-9d00-9f179e7ceca5\",\"content\":\"Musik juga dapat meningkatkan fungsi mental, mempercepat penyembuhan, dan meningkatkan rasa sejahtera setelah diterapi\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"e934e692-c46d-41b5-9c62-60d6a1bc4bb6\",\"content\":\"Peningkatan fungsi mental, percepatan penyembuhan, dan peningkatan rasa sejahtera dapat diperoleh melalui terapi musik\",\"is_true\":true,\"key\":\"E\"}]"'),
