	 ('b174e4ad-c8d2-4e3d-9f1b-98b8b9728fc8'::uuid,'17316cf5-33f2-4d60-bdef-7ce62e2e74d7'::uuid,'"[{\"id\":\"588d3b3c-1b24-4483-8f2c-4db61c79d692\",\"content\":\"Masalah pertanahan di Indonesia yang dapat menimbulkan konflik antarelemen di masyarakat dan dipicu oleh ketidakpastian hukum dapat diatasi dengan tekad semua pihak untuk mencari solusi yang tepat.\",\"is_true\":true,\"key\":\"A\"},{\"id\":\"f78cc349-d3ac-4f28-95ee-6686a54de5d7\",\"content\":\"Mafia tanah yang menjadi salah satu pemicu masalah tanah di Indonesia diperingatkan agar jangan mainmain dengan sengketa tanah antarelemen masyarakat sebab mereka bisa menjadi konflik.\",\"is_true\":false,\"key\":\"B\"},{\"id\":\"2c4add00-bd7d-4d51-9551-3f4623854dbf\",\"content\":\"Mencuatnya persoalan pertanahan di Indonesia disebabkan kegamangan pemerintah dan kekosongan instrumen hukum sehingga alasan rakyat menggarap tanah tidak ada landasan hukumnya.\",\"is_true\":false,\"key\":\"C\"},{\"id\":\"86294884-bec7-4af0-9b63-87692e14d228\",\"content\":\"Dengan terjadinya konflik pertanahan di berbagai daerah, perlu dibentuk tim penyelesaian sengketa tanah yang bertugas membuat pola penyelesaian masalah, menginventarisasi, dan memetakan kasus-kasus pertanahan.\",\"is_true\":false,\"key\":\"D\"},{\"id\":\"4631e2e9-44be-456d-9be5-a8b3a9f72ba0\",\"content\":\"Penyelesaian masalah sengketa lahan yakin dapat diatasi jika semua pihak ikut berpartisipasi secara positif demi tercapainya kehidupan yang aman dan sejahtera di tengah masyarakat Indonesia.\",\"is_true\":false,\"key\":\"E\"}]"'),
